core-shape:adms-Identifier a sh:NodeShape ;
    rdfs:label "Identifier" ;
    rdfs:comment "A character string to identify and distinguish uniquely, one instance of an object in an identification scheme from all other objects in the same scheme together with relevant supplementary information." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:adms-Identifier-adms-schemaAgency,
        core-shape:adms-Identifier-epo-hasScheme,
        core-shape:adms-Identifier-epo-hasSchemeVersion,
        core-shape:adms-Identifier-skos-notation ;
    sh:targetClass adms:Identifier .

core-shape:cccev-Constraint a sh:NodeShape ;
    rdfs:label "Constraint" ;
    rdfs:comment "Limitation applied to an Information Concept. Additional Information: Constraints are Requirements in themselves, since they impose prerequisites which influence the definition, use and/or Fulfilment of the Requirement. They represent hard conditions such as minimum or maximum expressions which can be used to evaluate pieces of information, the required age, income, involvement in activities, etc. An example from the eProcurement domain is a threshold as the minimum turnover required by the buying Organisation to select the Candidates. Note that CCCEV does not provide any specific guidance on when which kind of Requirement should be used. Users of this vocabulary should make decisions on this topic in their specific context." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:cccev-Constraint-cccev-constrains,
        core-shape:cccev-Constraint-epo-hasThresholdType,
        core-shape:cccev-Constraint-epo-hasThresholdValue ;
    sh:targetClass cccev:Constraint .

core-shape:cccev-Criterion a sh:NodeShape ;
    rdfs:label "Criterion" ;
    rdfs:comment "Condition for evaluation or assessment. Additional Information: In general, Criteria are used for comparison, filtering or Selection purposes. Criteria usually set minimum conditions (e.g. limits, intervals, thresholds, etc.) that need to be met in order to pass the Requirements or to fulfil them to a certain degree or quality. The concept of Criteria is broader than the concept of Constraint since it covers more usages. The evaluation of the fulfilment is usually supported by the provision of Evidence. For example in the eProcurement domain, the eProcurement Ontology defines different subclasses of Criterion such as Exclusion Grounds, Selection Criteria or Award Criteria. A concrete example of a Criterion is 'participation in a criminal organisation' which could also be considered as an Exclusion Ground Criterion in the procurement domain or for requiring a public service." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:cccev-Criterion-cccev-bias,
        core-shape:cccev-Criterion-cccev-weight,
        core-shape:cccev-Criterion-cccev-weightingConsiderationDescription,
        core-shape:cccev-Criterion-dct-type ;
    sh:targetClass cccev:Criterion .

core-shape:cccev-Evidence a sh:NodeShape ;
    rdfs:label "Evidence" ;
    rdfs:comment "Proof that a Requirement is met." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:cccev-Evidence-cccev-confidentialityLevelType,
        core-shape:cccev-Evidence-cccev-supportsConcept,
        core-shape:cccev-Evidence-cccev-supportsRequirement,
        core-shape:cccev-Evidence-epo-hasValidityPeriod ;
    sh:targetClass cccev:Evidence .

core-shape:cccev-InformationConcept a sh:NodeShape ;
    rdfs:label "Information concept" ;
    rdfs:comment "Piece of information that the Evidence provides or the Requirement needs." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:cccev-InformationConcept-adms-identifier,
        core-shape:cccev-InformationConcept-dct-description,
        core-shape:cccev-InformationConcept-skos-prefLabel ;
    sh:targetClass cccev:InformationConcept .

core-shape:cccev-Requirement a sh:NodeShape ;
    rdfs:label "Requirement" ;
    rdfs:comment "Condition or prerequisite that is to be proven by Evidence. Additional Information: Requirement is a generic class representing any type of prerequisite that may be desired, needed or imposed as an obligation. CCCEV recommends to not use the Requirement class directly, but rather a more semantically-enriched subclass such as Criterion, Information Requirement or Constraint. Also note that the Requirement class is specified at a more abstract level and is not to be used as the instantiation of a Requirement for a specific Agent. To illustrate the notion: the European Directive on services in the internal market defines requirement as any obligation, prohibition, condition or limit provided for in the laws, regulations or administrative provisions of the Member States or in consequence of case-law, administrative practice, the rules of professional bodies, or the collective rules of professional associations or other professional Organisations, adopted in the exercise of their legal autonomy. To stay consistent to how identification is realised in the eProcurement ontology, we switch to using `adms:identifier` instead of `dct:identifier` as per CCCEV specification." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:cccev-Requirement-adms-identifier,
        core-shape:cccev-Requirement-cccev-hasRequirement,
        core-shape:cccev-Requirement-dct-description,
        core-shape:cccev-Requirement-skos-prefLabel ;
    sh:targetClass cccev:Requirement .

core-shape:cpov-ContactPoint a sh:NodeShape ;
    rdfs:label "Contact point" ;
    rdfs:comment "Information (e.g. e-mail address, telephone number) of a Person or department through which the user can get in touch with. Additional information: This class represents the contact information for a Public Service, Channel, Public Organisation, etc. The Contact Point could be a role, email address, telephone number, etc. WG approval 5/11/2019" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:cpov-ContactPoint-cpov-email,
        core-shape:cpov-ContactPoint-cpov-telephone,
        core-shape:cpov-ContactPoint-dct-description,
        core-shape:cpov-ContactPoint-epo-hasContactName,
        core-shape:cpov-ContactPoint-epo-hasFax,
        core-shape:cpov-ContactPoint-epo-hasInternetAddress,
        core-shape:cpov-ContactPoint-locn-address ;
    sh:targetClass cccev:ContactPoint .

core-shape:cpov-PublicOrganisation a sh:NodeShape ;
    rdfs:label "Public organisation" ;
    rdfs:comment "An Organisation that is defined as being part of the public sector by a legal framework at any level. Additional information: A body governed by public law: - (a) established for the specific Purpose of meeting needs in the general interest - (b) having legal personality; - (c) financed, for the most part by the State, or regional or local authorities. Examples of Public Organisations are municipality, international public body, ministry, others. WG Approval 28/04/2020" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass cccev:PublicOrganisation .

core-shape:cv-Channel a sh:NodeShape ;
    rdfs:label "Channel" ;
    rdfs:comment "A medium through which Agents interact. Additional Information Typical examples include online services, email, endpoint on eDelivery infrastructure, phone, etc. Software solutions and electronic devices for communication and exchange of information between Buyers and economic Operators. Lots may use ad-hoc electronic means of communication that are not generally available such as specific solutions for secure and dedicated communication or non-standard eCatalogues. See also Directive recitals 53 to 56. WG approval 2023-02-14" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:cv-Channel-dct-description,
        core-shape:cv-Channel-epo-hasAddressURL,
        core-shape:cv-Channel-epo-hasEndpointIdentifier ;
    sh:targetClass cccev:Channel .

core-shape:dct-Location a sh:NodeShape ;
    rdfs:label "Location" ;
    rdfs:comment "An identifiable geographic place or named place." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:dct-Location-adms-identifier,
        core-shape:dct-Location-epo-hasCountryCode,
        core-shape:dct-Location-epo-hasNutsCode,
        core-shape:dct-Location-locn-address,
        core-shape:dct-Location-locn-geographicIdentifier,
        core-shape:dct-Location-locn-geographicName,
        core-shape:dct-Location-locn-geometry ;
    sh:targetClass dcterms:Location .

core-shape:epo-AccessTerm a sh:NodeShape ;
    rdfs:label "Access term" ;
    rdfs:comment "Conditions and stipulations about where and how to access the Procurement Documents. WG Approval 09/03/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-AccessTerm-epo-definesCatalogueProvider,
        core-shape:epo-AccessTerm-epo-definesCatalogueReceiver,
        core-shape:epo-AccessTerm-epo-definesOfflineAccessProvider,
        core-shape:epo-AccessTerm-epo-definesProcurementProcedureInformationProvider,
        core-shape:epo-AccessTerm-epo-hasAdditionalInformationDeadline,
        core-shape:epo-AccessTerm-epo-hasDocumentRestrictionJustification,
        core-shape:epo-AccessTerm-epo-hasPublicAccessURL,
        core-shape:epo-AccessTerm-epo-hasRestrictedAccessURL,
        core-shape:epo-AccessTerm-epo-involvesProcurementDocument,
        core-shape:epo-AccessTerm-epo-isProcurementDocumentRestricted,
        core-shape:epo-AccessTerm-epo-refersToPlannedPart ;
    sh:targetClass :AccessTerm .

core-shape:epo-AcquiringCentralPurchasingBody a sh:NodeShape ;
    rdfs:label "Acquiring central purchasing body" ;
    rdfs:comment "Role of an Agent procuring activities conducted on a permanent basis in the form of the acquisition of supplies and/or services intended for other Buyers. Additional Information: In Public Procurement the Role of Acquiring Central Purchasing Body is carried out by a Central Purchasing Body for other Contracting Authorities. WG approval 05/08/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :AcquiringCentralPurchasingBody .

core-shape:epo-AcquiringParty a sh:NodeShape ;
    rdfs:label "Acquiring party" ;
    rdfs:comment "The Role of an Agent that acts on the buying side of a Procurement Process." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :AcquiringParty .

core-shape:epo-AdHocChannel a sh:NodeShape ;
    rdfs:label "Ad hoc channel" ;
    rdfs:comment "Web page where tools and devices for electronic communication that are not generally available can be downloaded free of charge. Additional Information: This corresponds in eForms to BT-724 Tool Atypical. WG Acceptance 10/01/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :AdHocChannel .

core-shape:epo-AgentInRole a sh:NodeShape ;
    rdfs:label "Agent in role" ;
    rdfs:comment "Relative concept that ties an Agent to a part they play in a given Situational Context. Additional information: The classification of roles is based is based on the degree of involvement into the Procurement Process: - Primary (Procurement) Pole is directly involved in the Procurement Process; - Secondary (Procurement sub-) Role is secondary to the Procurement Process - Tertiary (Related) Role is not involved in the Procurement Process." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-AgentInRole-dct-description,
        core-shape:epo-AgentInRole-dct-title,
        core-shape:epo-AgentInRole-epo-contextualisedBy,
        core-shape:epo-AgentInRole-epo-exposesChannel,
        core-shape:epo-AgentInRole-epo-hasContactPointInRole,
        core-shape:epo-AgentInRole-epo-playedBy ;
    sh:targetClass :AgentInRole .

core-shape:epo-AuxiliaryParty a sh:NodeShape ;
    rdfs:label "Auxiliary party" ;
    rdfs:comment "Role of an Agent who may be mentioned in the information exchanged during the Procurement Process but who does not play an active part in it." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :AuxiliaryParty .

core-shape:epo-AwardCriteriaSummary a sh:NodeShape ;
    rdfs:label "Award criteria summary" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :AwardCriteriaSummary .

core-shape:epo-AwardCriterion a sh:NodeShape ;
    rdfs:label "Award criterion" ;
    rdfs:comment "Criterion that describes a Requirement that the Tender needs to resolve and on which the Tender is evaluated and ranked. WG approval 05/11/2018" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-AwardCriterion-epo-hasAwardCriteriaStatedInProcurementDocuments,
        core-shape:epo-AwardCriterion-epo-hasAwardCriterionType,
        core-shape:epo-AwardCriterion-epo-hasFixedValue,
        core-shape:epo-AwardCriterion-epo-hasFixedValueType ;
    sh:targetClass :AwardCriterion .

core-shape:epo-AwardDecision a sh:NodeShape ;
    rdfs:label "Award decision" ;
    rdfs:comment "Resolution of the Buyer as to the result of the Procurement Procedure. WG approval 14/11/2018" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-AwardDecision-epo-comprisesAwardOutcome,
        core-shape:epo-AwardDecision-epo-hasAdditionalNonAwardJustification,
        core-shape:epo-AwardDecision-epo-hasAwardDecisionDate ;
    sh:targetClass :AwardDecision .

core-shape:epo-AwardEvaluationTerm a sh:NodeShape ;
    rdfs:label "Award evaluation term" ;
    rdfs:comment "Conditions and stipulations defining particularities of the evaluation of Award Criteria." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-AwardEvaluationTerm-epo-hasAwardCriteriaEvaluationFormula,
        core-shape:epo-AwardEvaluationTerm-epo-hasAwardCriteriaOrderJustification,
        core-shape:epo-AwardEvaluationTerm-epo-hasOverallCostAwardCriteriaPonderation,
        core-shape:epo-AwardEvaluationTerm-epo-hasOverallPriceAwardCriteriaPonderation,
        core-shape:epo-AwardEvaluationTerm-epo-hasOverallQualityAwardCriteriaPonderation ;
    sh:targetClass :AwardEvaluationTerm .

core-shape:epo-AwardOutcome a sh:NodeShape ;
    rdfs:label "Award outcome" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-AwardOutcome-epo-comprisesTenderAwardOutcome,
        core-shape:epo-AwardOutcome-epo-hasAwardStatus,
        core-shape:epo-AwardOutcome-epo-hasAwardedValue,
        core-shape:epo-AwardOutcome-epo-hasBargainPrice,
        core-shape:epo-AwardOutcome-epo-hasNonAwardJustification ;
    sh:targetClass :AwardOutcome .

core-shape:epo-Awarder a sh:NodeShape ;
    rdfs:label "Awarder" ;
    rdfs:comment "A Role of an Agent that signs the Award Decision. Additional Information: BT-08 can be Awarding CBP; BG-03 is the Buyer. But Awarding CPB is not the same as the Buyer; the organisations may differ for these roles. Having the Awarder Role allows us to specify which Organisation is involved in the Award Decision." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :Awarder .

core-shape:epo-AwardingCentralPurchasingBody a sh:NodeShape ;
    rdfs:label "Awarding central purchasing body" ;
    rdfs:comment "Role of an Agent procuring activities conducted on a permanent basis in the form of the award of Public Contracts or the conclusion of Framework Agreements for works, supplies or services intended for other Buyers. Additional Information: In Public Procurement the Role of Awarding Central purchasing Body is carried out by a Central Purchasing Body for other Contracting Authorities. WG approval 05/08/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :AwardingCentralPurchasingBody .

core-shape:epo-BudgetProvider a sh:NodeShape ;
    rdfs:label "Budget provider" ;
    rdfs:comment "A role of an agent whose Budget is used to pay for the Contract." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :BudgetProvider .

core-shape:epo-Business a sh:NodeShape ;
    rdfs:label "Business" ;
    rdfs:comment "A private law company registered in a national registry. WG Approval 28/04/2020" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Business-epo-hasBeneficialOwner,
        core-shape:epo-Business-epo-hasBusinessSize,
        core-shape:epo-Business-epo-isListedCompany ;
    sh:targetClass :Business .

core-shape:epo-Buyer a sh:NodeShape ;
    rdfs:label "Buyer" ;
    rdfs:comment "A Role of an Agent that awards a Contract and/or purchases items. Additional information: In Public Procurement the Role of Buyer is carried out by the following types of Organisation: Contracting Authority, Contracting Entity, a defense Contractor, an international Organisation, or an organisation awarding a Contract subsidized by a Contracting Authority. In Pre-Award, the Buyer generally awards the Contract, however future purchasers may be foreseen. In Post-Award the buyer generally refers to the purchaser of items." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Buyer-epo-delegatesAncillaryActivitiesTo,
        core-shape:epo-Buyer-epo-exposesInvoiceeChannel,
        core-shape:epo-Buyer-epo-hasActivityDescription,
        core-shape:epo-Buyer-epo-hasBuyerProfile,
        core-shape:epo-Buyer-epo-indicatesInvoiceeContactPoint,
        core-shape:epo-Buyer-epo-isContractingEntity,
        core-shape:epo-Buyer-epo-signsAwardDecision ;
    sh:targetClass :Buyer .

core-shape:epo-Candidate a sh:NodeShape ;
    rdfs:label "Candidate" ;
    rdfs:comment "The Role of an Agent that has sought an invitation or has been invited to take part in a restricted Procedure, in a competitive Procedure with negotiation, in a negotiated Procedure without prior publication, in a competitive dialogue or in an innovation partnership. WG approval 30/05/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :Candidate .

core-shape:epo-CatalogueProvider a sh:NodeShape ;
    rdfs:label "Catalogue provider" ;
    rdfs:comment "A Role of an Agent compiling and supplying a Catalogue. Additional Information: The Catalogue Provider Role is usually played by the Agent that acts as a Seller, or by another Agent that acts on behalf of the Seller. WG Approval 28/01/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :CatalogueProvider .

core-shape:epo-CatalogueReceiver a sh:NodeShape ;
    rdfs:label "Catalogue receiver" ;
    rdfs:comment "A Role of an Agent processing a Catalogue. Additional Information: The Catalogue Receiver may not only receive it but also validate it, process it, etc. The Catalogue Receiver role is usually played by the agent that acts as a Buyer, or by another Agent that acts on behalf of the Buyer. WG Approval 28/01/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :CatalogueReceiver .

core-shape:epo-CentralPurchasingBody a sh:NodeShape ;
    rdfs:label "Central purchasing body" ;
    rdfs:comment "Role of an Agent that provides centralised purchasing activities and, possibly, ancillary purchasing activities for other Buyers. Additional Information: In Public Procurement the Role of Central Purchasing Body is carried out by a Contracting Authority for other Contracting Authorities. Contracting Authority procuring activities conducted on a permanent basis, in one of the following forms:[...](b) the award of Public Contracts or the conclusion of Framework Agreements for works, supplies or services intended for Contracting Authorities; WG approval 05/08/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :CentralPurchasingBody .

core-shape:epo-Certificate a sh:NodeShape ;
    rdfs:label "Certificate" ;
    rdfs:comment "Proof of conformance of the instance of the concept to a defined set of criteria. Additional Information: Certificates provide assurance of credibility, trust, and transparency in the procurement process. WG approval 16/05/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Certificate-epo-attestedByLabel,
        core-shape:epo-Certificate-epo-hasCertificationNumber,
        core-shape:epo-Certificate-epo-hasURL,
        core-shape:epo-Certificate-epo-issuedByCertifier ;
    sh:targetClass :Certificate .

core-shape:epo-CertificationLabel a sh:NodeShape ;
    rdfs:label "Certification label" ;
    rdfs:comment "Concept that stands for a set of norms, expectations, standards and policies. Additional Information: Such standards may relate to social, ethical and quality etc. WG approval 26/07/2022" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-CertificationLabel-epo-hasLabelType,
        core-shape:epo-CertificationLabel-epo-hasReferenceURI ;
    sh:targetClass :CertificationLabel .

core-shape:epo-Certifier a sh:NodeShape ;
    rdfs:label "Certifier" ;
    rdfs:comment "The role of an agent who issues a certificate. Additional Information: The certifier is responsible for verifying and confirming the conformance of the instance of the concept to a defined set of criteria. WG approval 16/05/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :Certifier .

core-shape:epo-ChangeInformation a sh:NodeShape ;
    rdfs:label "Change information" ;
    rdfs:comment "Added hasAdditionalInformation to cover for section VII.2 in F14, since we do not have the Corrigendum notice type anymore in eForms.",
        "Alteration to previously provided details." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ChangeInformation-epo-concernsNotice,
        core-shape:epo-ChangeInformation-epo-hasAdditionalInformation,
        core-shape:epo-ChangeInformation-epo-hasChangeDescription,
        core-shape:epo-ChangeInformation-epo-hasChangeJustification,
        core-shape:epo-ChangeInformation-epo-hasChangeReasonDescription,
        core-shape:epo-ChangeInformation-epo-hasProcurementDocumentChangeDate,
        core-shape:epo-ChangeInformation-epo-isProcurementDocumentChanged,
        core-shape:epo-ChangeInformation-epo-refersToPreviousNotice,
        core-shape:epo-ChangeInformation-epo-relatesToEFormSectionIdentifier ;
    sh:targetClass :ChangeInformation .

core-shape:epo-ConcessionContract a sh:NodeShape ;
    rdfs:label "Concession contract" ;
    rdfs:comment "A Contract between one or more Buyers and one or more Economic Operators giving the right to the Economic Operators to exploit the rights foreseen in the Contract which may include the receipt of Payments. WG Approval 24/05/2022" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ConcessionContract .

core-shape:epo-ConcessionEstimate a sh:NodeShape ;
    rdfs:label "Concession estimate" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ConcessionEstimate-epo-hasCalculationMethod,
        core-shape:epo-ConcessionEstimate-epo-hasConcessionEstimatedValue,
        core-shape:epo-ConcessionEstimate-epo-hasEstimatedBuyerConcessionRevenue,
        core-shape:epo-ConcessionEstimate-epo-hasEstimatedUserConcessionRevenue ;
    sh:targetClass :ConcessionEstimate .

core-shape:epo-ContextDescription a sh:NodeShape ;
    rdfs:label "Context description" ;
    rdfs:comment "A description concerning a Procurement Object or a Notice in a specific Situation Context. Additional Information: The description has its own identity (+I) but is dependent (+D) on the concerned Entity. We say that ContextSpecificDescription *concerns* an Entity." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ContextDescription .

core-shape:epo-ContextualProjection a sh:NodeShape ;
    rdfs:label "Contextual projection" ;
    rdfs:comment "Projection of an Entity and all of its properties that hold in a given Situation Context. Additional Information: The contextual projection does not have its own identity (-I), is dependent (+D) on the described Entity, and is anti-rigid (~R) We say that ContextualProjection *describes* an Entity. Adaptation of ContextSlices pattern encoding a 4D view. http://ontologydesignpatterns.org/wiki/Submissions:Context_Slices" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ContextualProjection .

core-shape:epo-Contract a sh:NodeShape ;
    rdfs:label "Contract" ;
    rdfs:comment "A voluntary, deliberate, and legally binding agreement between two or more competent parties. Additional information: This includes Concession Contracts. WG approval 01/06/2018" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Contract-epo-bindsBuyer,
        core-shape:epo-Contract-epo-bindsContractor,
        core-shape:epo-Contract-epo-hasContractConclusionDate,
        core-shape:epo-Contract-epo-hasContractValue,
        core-shape:epo-Contract-epo-hasEntryIntoForceDate,
        core-shape:epo-Contract-epo-hasEstimatedDuration,
        core-shape:epo-Contract-epo-hasLotReference,
        core-shape:epo-Contract-epo-hasPurpose,
        core-shape:epo-Contract-epo-includesTender,
        core-shape:epo-Contract-epo-isFundedBy,
        core-shape:epo-Contract-epo-isSubjectToContractSpecificTerm,
        core-shape:epo-Contract-epo-signedByBuyer,
        core-shape:epo-Contract-epo-signedByContractor ;
    sh:targetClass :Contract .

core-shape:epo-ContractLotCompletionInformation a sh:NodeShape ;
    rdfs:label "Contract lot completion information" ;
    rdfs:comment "Information related to a given Lot at the end of the procurement." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ContractLotCompletionInformation-epo-describesLotCompletion,
        core-shape:epo-ContractLotCompletionInformation-epo-hasPaymentValueDiscrepancyJustification,
        core-shape:epo-ContractLotCompletionInformation-epo-providesContractTotalPaymentValue,
        core-shape:epo-ContractLotCompletionInformation-epo-providesContractTotalPenaltyValue,
        core-shape:epo-ContractLotCompletionInformation-epo-refersToContract ;
    sh:targetClass :ContractLotCompletionInformation .

core-shape:epo-ContractSpecificTerm a sh:NodeShape ;
    rdfs:label "Contract specific term" ;
    rdfs:comment "Gathering class for conditions and stipulations related to a contract in the Post-Award Phase." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ContractSpecificTerm .

core-shape:epo-ContractTerm a sh:NodeShape ;
    rdfs:label "Contract term" ;
    rdfs:comment "Conditions and stipulations defining particularities of the Post Award Phase. (WG approval 23/11/2018)" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ContractTerm-epo-definesContractDuration,
        core-shape:epo-ContractTerm-epo-definesContractPeriod,
        core-shape:epo-ContractTerm-epo-definesPaymentExecutor,
        core-shape:epo-ContractTerm-epo-definesSpecificPlaceOfPerformance,
        core-shape:epo-ContractTerm-epo-definesSubcontractingTerm,
        core-shape:epo-ContractTerm-epo-hasAdditionalContractNature,
        core-shape:epo-ContractTerm-epo-hasBroadPlaceOfPerformance,
        core-shape:epo-ContractTerm-epo-hasContractNatureType,
        core-shape:epo-ContractTerm-epo-hasEInvoicing,
        core-shape:epo-ContractTerm-epo-hasEInvoicingPermission,
        core-shape:epo-ContractTerm-epo-hasEOrdering,
        core-shape:epo-ContractTerm-epo-hasEPayment,
        core-shape:epo-ContractTerm-epo-hasLegalFormRequirement,
        core-shape:epo-ContractTerm-epo-hasMaximumNumberOfRenewals,
        core-shape:epo-ContractTerm-epo-hasOptions,
        core-shape:epo-ContractTerm-epo-hasOptionsDescription,
        core-shape:epo-ContractTerm-epo-hasPaymentArrangement,
        core-shape:epo-ContractTerm-epo-hasPerformanceConditions,
        core-shape:epo-ContractTerm-epo-hasPlaceOfPerformanceAdditionalInformation,
        core-shape:epo-ContractTerm-epo-hasRenewalDescription,
        core-shape:epo-ContractTerm-epo-hasReservedExecution,
        core-shape:epo-ContractTerm-epo-isRenewalIndicator ;
    sh:targetClass :ContractTerm .

core-shape:epo-Contractor a sh:NodeShape ;
    rdfs:label "Contractor" ;
    rdfs:comment "The Role of an Agent that has signed a Contract with a Buyer. WG approval 08/11/2022" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Contractor-epo-needsToBeAWinner ;
    sh:targetClass :Contractor .

core-shape:epo-DesignContestRegimeTerm a sh:NodeShape ;
    rdfs:label "Design contest regime term" ;
    rdfs:comment "Conditions and stipulations defining particularities of a Design Contest. WG approval: 04-02-2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-DesignContestRegimeTerm-epo-definesPrize,
        core-shape:epo-DesignContestRegimeTerm-epo-hasDescriptionOfPrizes,
        core-shape:epo-DesignContestRegimeTerm-epo-hasFollowupContract,
        core-shape:epo-DesignContestRegimeTerm-epo-hasFollowupContractInformation,
        core-shape:epo-DesignContestRegimeTerm-epo-hasParticipationPayment,
        core-shape:epo-DesignContestRegimeTerm-epo-isJuryDecisionBinding ;
    sh:targetClass :DesignContestRegimeTerm .

core-shape:epo-DirectAwardTerm a sh:NodeShape ;
    rdfs:label "Direct award term" ;
    rdfs:comment "Conditions and stipulations defining particularities of the award of a Contract without prior publication. Addtional Information: Direct award may refer to a previous Procedure and/or specific Lot(s). It may also refer to other justified situations whereby there is no previous Procedure. See Directive 2014/24/EU Article 32. WG Approval 22/11/2019" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-DirectAwardTerm-epo-hasDirectAwardJustification,
        core-shape:epo-DirectAwardTerm-epo-hasJustification,
        core-shape:epo-DirectAwardTerm-epo-refersToPreviousProcedure,
        core-shape:epo-DirectAwardTerm-epo-refersToPreviousProcedureLot ;
    sh:targetClass :DirectAwardTerm .

core-shape:epo-DirectContract a sh:NodeShape ;
    rdfs:label "Direct contract" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-DirectContract-epo-resultsFromLotAwardOutcome ;
    sh:targetClass :DirectContract .

core-shape:epo-Document a sh:NodeShape ;
    rdfs:label "Document" ;
    rdfs:comment "A set of interrelated Business Information representing the Business facts and associated metadata. The information may be conveyed in any language, medium or form, including textual, numerical, graphic, cartographic, audio-visual forms, etc. WG Approval 23/05/2019" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Document-adms-identifier,
        core-shape:epo-Document-dct-description,
        core-shape:epo-Document-dct-issued,
        core-shape:epo-Document-dct-title,
        core-shape:epo-Document-epo-associatedWith,
        core-shape:epo-Document-epo-hasAccessURL,
        core-shape:epo-Document-epo-hasDispatchDate,
        core-shape:epo-Document-epo-hasElectronicDigest,
        core-shape:epo-Document-epo-hasElectronicSignature,
        core-shape:epo-Document-epo-hasOfficialLanguage,
        core-shape:epo-Document-epo-hasPublicationDate,
        core-shape:epo-Document-epo-hasReceptionDate,
        core-shape:epo-Document-epo-hasUUID,
        core-shape:epo-Document-epo-hasUnofficialLanguage,
        core-shape:epo-Document-epo-hasVersion,
        core-shape:epo-Document-epo-refersToPrevious ;
    sh:targetClass :Document .

core-shape:epo-Duration a sh:NodeShape ;
    rdfs:label "Duration" ;
    rdfs:comment "The length of time in which a concept occurs." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :Duration .

core-shape:epo-DynamicPurchaseSystemTechnique a sh:NodeShape ;
    rdfs:label "Dynamic purchase system technique" ;
    rdfs:comment "A Technique that allows the selection of Candidates throughout the Procedure via the Qualification Criteria, followed by individual Mini-Competitions for the Award of Purchase Contracts. WG approval 23/05/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-DynamicPurchaseSystemTechnique-epo-hasDPSScope ;
    sh:targetClass :DynamicPurchaseSystemTechnique .

core-shape:epo-EAuctionTechnique a sh:NodeShape ;
    rdfs:label "E auction technique" ;
    rdfs:comment "A repetitive Technique in which new Prices, revised downwards, and/or new values concerning certain elements of Tenders are bid on-line. Additional Information: This corresponds in eForms to BT-767 Electronic Auction . WG approval 20/07/2018" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :EAuctionTechnique .

core-shape:epo-EconomicStandingSummary a sh:NodeShape ;
    rdfs:label "Economic standing summary" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :EconomicStandingSummary .

core-shape:epo-ElectronicSignature a sh:NodeShape ;
    rdfs:label "Electronic signature" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ElectronicSignature-dct-description ;
    sh:targetClass :ElectronicSignature .

core-shape:epo-EmploymentInformationProvider a sh:NodeShape ;
    rdfs:label "Employment information provider" ;
    rdfs:comment "A Role of an Agent responsible for providing information concerning the general regulatory framework for employment protection and working conditions." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :EmploymentInformationProvider .

core-shape:epo-EnvironmentalProtectionInformationProvider a sh:NodeShape ;
    rdfs:label "Environmental protection information provider" ;
    rdfs:comment "A Role of an Agent responsible for providing information concerning the general regulatory framework for Environmental Protection." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :EnvironmentalProtectionInformationProvider .

core-shape:epo-Estimate a sh:NodeShape ;
    rdfs:label "Estimate" ;
    rdfs:comment "An approximate calculation or a judgement of the value, number, Quantity or extent of something." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :Estimate .

core-shape:epo-EvaluationTerm a sh:NodeShape ;
    rdfs:label "Evaluation term" ;
    rdfs:comment "Conditions and stipulations defining particularities of the Tender evaluation. (WG approval 23/11/2018)" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :EvaluationTerm .

core-shape:epo-ExclusionGround a sh:NodeShape ;
    rdfs:label "Exclusion ground" ;
    rdfs:comment "Criterion that describes a legal Requirement to be met by the Economic Operator to be a Candidate in the Procurement. Additional Information: This corresponds in eForms to BG-701 Exclusion Grounds. WG approval 31/10/2018" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ExclusionGround .

core-shape:epo-ExclusionGroundsSummary a sh:NodeShape ;
    rdfs:label "Exclusion grounds summary" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ExclusionGroundsSummary .

core-shape:epo-ExpressionOfInterest a sh:NodeShape ;
    rdfs:label "Expression of interest" ;
    rdfs:comment "Document presenting an Economic Operator's Request to be considered for Procedures covering a specific domain. WG approval 13/04/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ExpressionOfInterest .

core-shape:epo-FrameworkAgreement a sh:NodeShape ;
    rdfs:label "Framework agreement" ;
    rdfs:comment "An agreement between one or more Contracting Authorities and one or more Economic Operators. Additional Information: When a Framework Agreement is concerned, the FA will result from LotAwardOutcome which describes a Lot which specifies the both the Qualification and Award Criteria. WG approval 18/05/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-FrameworkAgreement-epo-resultsFromLotAwardOutcome ;
    sh:targetClass :FrameworkAgreement .

core-shape:epo-FrameworkAgreementTechnique a sh:NodeShape ;
    rdfs:label "Framework agreement technique" ;
    rdfs:comment "Technique that establishes the terms governing Contracts to be awarded during a given Period, in particular with regard to Price and, where appropriate, the Quantity envisaged. WG approval 18/05/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :FrameworkAgreementTechnique .

core-shape:epo-FrameworkAgreementTerm a sh:NodeShape ;
    rdfs:label "Framework agreement term" ;
    rdfs:comment "Conditions and stipulations defining particularities in a Framework Agreement." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-FrameworkAgreementTerm-epo-hasBuyerCategoryDescription,
        core-shape:epo-FrameworkAgreementTerm-epo-hasDurationExtensionJustification,
        core-shape:epo-FrameworkAgreementTerm-epo-hasFrameworkAgreementType,
        core-shape:epo-FrameworkAgreementTerm-epo-hasMaximumParticipantsNumber ;
    sh:targetClass :FrameworkAgreementTerm .

core-shape:epo-Fund a sh:NodeShape ;
    rdfs:label "Fund" ;
    rdfs:comment "A financial resource used to support the Procurement. Additional Information: In the context of EU, Funds can be divided into programmes, actions and projects. Examples of EU funds are: the European Structural and Investment Funds, European Social Fund (ESF), the Connecting Europe Facility (CEF) programme, or the ISA2 programme and its actions (e.g. Action 2016.05 European Public Procurement Initiative, which supports the eProcurement Ontology under sub-action 3). Funds may change between the lot and the contract, for example in the case of an emergency crisis, a contract may be financed by a budget that was not foreseen in the call. WG Approved 14/05/2019" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Fund-adms-identifier,
        core-shape:epo-Fund-dct-description,
        core-shape:epo-Fund-dct-title,
        core-shape:epo-Fund-epo-hasFundProgramme,
        core-shape:epo-Fund-epo-hasURL ;
    sh:targetClass :Fund .

core-shape:epo-GreenProcurement a sh:NodeShape ;
    rdfs:label "Green procurement" ;
    rdfs:comment "Approach whereby Buyers seek to procure with a reduced Environmental Impact. Additional Information: The approach may apply to the complete life cycle. The reduced Environmental Impact is in comparison to goods, services and works with the same primary function that would otherwise be procured. Tightly related are article 68 - Life-cycle costing and article 67 - most economically advantageous Tender (see GPP handbook) https://ec.europa.eu/environment/gpp/pdf/Buying-Green-Handbook-3rd-Edition.pdf An instance of the class GreenProcurement is represented in eForms with the code \"env-imp\" defined in the codelist Strategic-Procurement.Paragraphs) https://ec.europa.eu/environment/gpp/pdf/Buying-Green-Handbook-3rd-Edition.pdf" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-GreenProcurement-epo-fulfillsRequirement,
        core-shape:epo-GreenProcurement-epo-usesCleanVehicleDirective ;
    sh:targetClass :GreenProcurement .

core-shape:epo-IndefiniteDuration a sh:NodeShape ;
    rdfs:label "Indefinite duration" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :IndefiniteDuration .

core-shape:epo-InnovativeProcurement a sh:NodeShape ;
    rdfs:label "Innovative procurement" ;
    rdfs:comment "Approach whereby Buyers seek to procure an innovative work, supply or service. Additional Information: innovation means the implementation of a new or significantly improved product, service or process, including but not limited to production, building or construction processes, a new marketing method, or a new organizational method in business practices, workplace Organisation or external relations inter alia with the purpose of helping to solve societal challenges or to support the Europe 2020 strategy for smart, sustainable and inclusive growth; See: Directive 2014/24 Articles: 2, 26 (3), 31, 67 (2.a)" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-InnovativeProcurement-epo-fulfillsRequirement ;
    sh:targetClass :InnovativeProcurement .

core-shape:epo-JuryMember a sh:NodeShape ;
    rdfs:label "Jury member" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-JuryMember-epo-playedBy ;
    sh:targetClass :JuryMember .

core-shape:epo-LeadBuyer a sh:NodeShape ;
    rdfs:label "Lead buyer" ;
    rdfs:comment "A Role of an Agent who is a Buyer and takes the administrative lead of the Procedure. WG agreement: 2022-11-22" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :LeadBuyer .

core-shape:epo-Lot a sh:NodeShape ;
    rdfs:label "Lot" ;
    rdfs:comment "A qualitative, quantitative or strategic subdivision of the goods, services or works to be procured, allowing the award of one or more Contracts. WG approval 12/09/2018" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Lot-epo-isSubjectToLotSpecificTerm,
        core-shape:epo-Lot-epo-specifiesProcurementCriterion ;
    sh:targetClass :Lot .

core-shape:epo-LotAwardOutcome a sh:NodeShape ;
    rdfs:label "Lot award outcome" ;
    rdfs:comment "Result concerning the Lot attributed by the Awarder." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-LotAwardOutcome-epo-concernsLot,
        core-shape:epo-LotAwardOutcome-epo-hasApproximateFrameworkAgreementValue,
        core-shape:epo-LotAwardOutcome-epo-hasFrameworkAgreementMaximumValue,
        core-shape:epo-LotAwardOutcome-epo-hasNonAwardedContractNumber,
        core-shape:epo-LotAwardOutcome-epo-hasNonAwardedContractTitle ;
    sh:targetClass :LotAwardOutcome .

core-shape:epo-LotGroup a sh:NodeShape ;
    rdfs:label "Lot group" ;
    rdfs:comment "Combination of several Lots to conduct comparative assessment of the Tenders. Additional Information: The comparative assessment may refer to the Selection Criteria, Award and Value that apply to several Lots. Pending of discussion with eForms Member States may provide that, where more than one lot may be awarded to the same tenderer, contracting authorities may award contracts combining several or all lots where they have specified in the contract notice or in the invitation to confirm interest that they reserve the possibility of doing so and indicate the lots or groups of lots that may be combined." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-LotGroup-adms-identifier,
        core-shape:epo-LotGroup-dct-description,
        core-shape:epo-LotGroup-dct-title,
        core-shape:epo-LotGroup-epo-hasEstimatedValue,
        core-shape:epo-LotGroup-epo-hasInternalIdentifier,
        core-shape:epo-LotGroup-epo-hasLaunchFrameworkAgreementMaximumValue,
        core-shape:epo-LotGroup-epo-setsGroupingContextForLot,
        core-shape:epo-LotGroup-epo-specifiesProcurementCriterion ;
    sh:targetClass :LotGroup .

core-shape:epo-LotGroupAwardInformation a sh:NodeShape ;
    rdfs:label "Lot group award information" ;
    rdfs:comment "Award information related to a given Group of Lots." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-LotGroupAwardInformation-epo-describesLotGroup,
        core-shape:epo-LotGroupAwardInformation-epo-hasGroupFrameworkAgreementMaximumValue ;
    sh:targetClass :LotGroupAwardInformation .

core-shape:epo-LotSpecificTerm a sh:NodeShape ;
    rdfs:label "Lot specific term" ;
    rdfs:comment "Gathering class for conditions and stipulations related to a Lot." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :LotSpecificTerm .

core-shape:epo-Mediator a sh:NodeShape ;
    rdfs:label "Mediator" ;
    rdfs:comment "A Role of an Agent that attempts to resolve a dispute between different Agents and come to an agreement. WG approval 20/04/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :Mediator .

core-shape:epo-MiniCompetitionAwardOutcome a sh:NodeShape ;
    rdfs:label "Mini competition award outcome" ;
    rdfs:comment "Result concerning the process where multiple winners or candidates of previous stages of a procedure bid for a specific procurement attributed by the Awarder. Additional Information: It is typically used in framework agreements where the suppliers have already been pre-selected, and the mini competition is used to determine which supplier is best suited for a particular project or contract. It is also used in a Dynamic Purchasing System where the suppliers come from a list of Candidates." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-MiniCompetitionAwardOutcome-epo-resultsFromUsingCandidateList ;
    sh:targetClass :MiniCompetitionAwardOutcome .

core-shape:epo-MonetaryValue a sh:NodeShape ;
    rdfs:label "Monetary value" ;
    rdfs:comment "A number of monetary units specified using a given unit of currency. Additional information: In the pre-award phase of the procurement, all monetary values are considered to exclude VAT based on the Directive 2014/24/EU. WG approval 13/04/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-MonetaryValue-epo-hasAmountValue,
        core-shape:epo-MonetaryValue-epo-hasCurrency,
        core-shape:epo-MonetaryValue-epo-hasCurrencyCodeListAgencyID,
        core-shape:epo-MonetaryValue-epo-hasCurrencyCodeListAgencyName,
        core-shape:epo-MonetaryValue-epo-hasCurrencyCodeListID ;
    sh:targetClass :MonetaryValue .

core-shape:epo-MultipleStageProcedureTerm a sh:NodeShape ;
    rdfs:label "Multiple stage procedure term" ;
    rdfs:comment "Conditions and stipulations defining particularities of Procedures carried out in several steps Additional Information: Generally this refers to Procedures where selection is carried out to qualify Tenderers who are then requested to submit the rest of their Tender for evaluation is Restricted Procedure. WG Approval 15/04/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-MultipleStageProcedureTerm-epo-hasEstimatedInvitationToExpressInterestDate,
        core-shape:epo-MultipleStageProcedureTerm-epo-hasEstimatedInvitationToTenderDate,
        core-shape:epo-MultipleStageProcedureTerm-epo-hasMaximumNumberOfCandidates,
        core-shape:epo-MultipleStageProcedureTerm-epo-hasMinimumNumberOfCandidates,
        core-shape:epo-MultipleStageProcedureTerm-epo-hasNoNegotiationNecessary,
        core-shape:epo-MultipleStageProcedureTerm-epo-hasQualificationSystemDuration,
        core-shape:epo-MultipleStageProcedureTerm-epo-hasQualificationSystemRenewalDescription,
        core-shape:epo-MultipleStageProcedureTerm-epo-hasSuccessiveReduction ;
    sh:targetClass :MultipleStageProcedureTerm .

core-shape:epo-NonDisclosureAgreementTerm a sh:NodeShape ;
    rdfs:label "Non disclosure agreement term" ;
    rdfs:comment "Conditions and stipulations" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-NonDisclosureAgreementTerm-dct-description,
        core-shape:epo-NonDisclosureAgreementTerm-epo-isNonDisclosureAgreementRequired ;
    sh:targetClass :NonDisclosureAgreementTerm .

core-shape:epo-NonPublishedInformation a sh:NodeShape ;
    rdfs:label "Non published information" ;
    rdfs:comment "Information about fields not published in this Notice. Additional Information: The non-published information may become available at a later date and may differ from one element to another within a given Document. Examples of fields that may not be immediately published are Winner, Tender and Procedure Lot Result, etc., e.g. for security reasons." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-NonPublishedInformation-epo-concernsNotice,
        core-shape:epo-NonPublishedInformation-epo-hasAccessibilityDate,
        core-shape:epo-NonPublishedInformation-epo-hasConfidentialityJustification,
        core-shape:epo-NonPublishedInformation-epo-hasNonPublicationJustification,
        core-shape:epo-NonPublishedInformation-epo-relatesToEFormSectionIdentifier ;
    sh:targetClass :NonPublishedInformation .

core-shape:epo-Notice a sh:NodeShape ;
    rdfs:label "Notice" ;
    rdfs:comment "Document published by the Buyer about market opportunities and results. WG Approval 23/05/2019" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Notice-epo-conformsToLegalBasis,
        core-shape:epo-Notice-epo-hasAdditionalInformation,
        core-shape:epo-Notice-epo-hasEFormsSubtype,
        core-shape:epo-Notice-epo-hasESenderDispatchDate,
        core-shape:epo-Notice-epo-hasFormNumber,
        core-shape:epo-Notice-epo-hasFormType,
        core-shape:epo-Notice-epo-hasNoticePublicationNumber,
        core-shape:epo-Notice-epo-hasNoticeType,
        core-shape:epo-Notice-epo-hasOJSIssueNumber,
        core-shape:epo-Notice-epo-hasOJSType,
        core-shape:epo-Notice-epo-isBasedOnImplementingRegulation,
        core-shape:epo-Notice-epo-refersToLot,
        core-shape:epo-Notice-epo-refersToNotice,
        core-shape:epo-Notice-epo-refersToProcedure ;
    sh:targetClass :Notice .

core-shape:epo-NoticeAwardInformation a sh:NodeShape ;
    rdfs:label "Notice award information" ;
    rdfs:comment "Information about an Award Notice." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-NoticeAwardInformation-epo-hasApproximateFrameworkAgreementValue,
        core-shape:epo-NoticeAwardInformation-epo-hasMaximumFrameworkAgreementAwardedValue,
        core-shape:epo-NoticeAwardInformation-epo-hasProcurementHighestReceivedTenderValue,
        core-shape:epo-NoticeAwardInformation-epo-hasProcurementLowestReceivedTenderValue,
        core-shape:epo-NoticeAwardInformation-epo-hasTotalAwardedValue ;
    sh:targetClass :NoticeAwardInformation .

core-shape:epo-Offer a sh:NodeShape ;
    rdfs:label "Offer" ;
    rdfs:comment "Document providing the Monetary Value and the details to fulfill the Requirements set out in the Procurement Documents or Request for Offer. Additional information: A quotation is considered to be an Offer in the eProcurement Ontology. WG approval 09/02/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :Offer .

core-shape:epo-OfferIssuer a sh:NodeShape ;
    rdfs:label "Offer issuer" ;
    rdfs:comment "The Role of an Agent that distributes an Offer. WG approval 09/02/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-OfferIssuer-epo-distributesOffer ;
    sh:targetClass :OfferIssuer .

core-shape:epo-OfferingParty a sh:NodeShape ;
    rdfs:label "Offering party" ;
    rdfs:comment "The Role of an Agent that acts on the Economic Operator side during a Procurement Process. Additional information: As per the European Procurement Directives the notion of Economic Operators should be interpreted in a broad manner so as to include any Persons and/or Entities which offer the execution of works, the supply of products or the provision of services on the market, irrespective of the legal form under which they have chosen to operate. Thus, firms, branches, subsidiaries, partnerships, cooperative societies, limited companies, universities, public or private, and other forms of entities than natural Persons should all fall within the notion of Economic Operator, whether or not they are Legal Persons in all circumstances." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :OfferingParty .

core-shape:epo-OfflineAccessProvider a sh:NodeShape ;
    rdfs:label "Offline access provider" ;
    rdfs:comment "A Role of an Agent responsible for providing offline access to the Procurement Documents." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :OfflineAccessProvider .

core-shape:epo-OpeningTerm a sh:NodeShape ;
    rdfs:label "Opening term" ;
    rdfs:comment "Conditions and stipulations defining particularities of the opening of Tenders. Additional Information: The opening of Tenders is the event when Tenders are made accessible for evaluation, it is generally the same date and time for all Tenders. WG Approval 15/04/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-OpeningTerm-epo-definesOpeningPlace,
        core-shape:epo-OpeningTerm-epo-hasOpeningDateTime,
        core-shape:epo-OpeningTerm-epo-hasOpeningDescription,
        core-shape:epo-OpeningTerm-epo-hasOpeningURL ;
    sh:targetClass :OpeningTerm .

core-shape:epo-OrganisationGroup a sh:NodeShape ;
    rdfs:label "Organisation group" ;
    rdfs:comment "Agreed collaboration of several Organisations. Additional Information: This concept has been created to fulfill the need to represent a grouping of Organisations that is not necessarily registered i.e, consortia. WG approval 15/04/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-OrganisationGroup-epo-hasGroupType,
        core-shape:epo-OrganisationGroup-epo-hasMember,
        core-shape:epo-OrganisationGroup-epo-leadBy ;
    sh:targetClass :OrganisationGroup .

core-shape:epo-OriginatorRequest a sh:NodeShape ;
    rdfs:label "Originator request" ;
    rdfs:comment "Document in which the Originator describes his needs. WG approval 09/02/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :OriginatorRequest .

core-shape:epo-OtherEntity a sh:NodeShape ;
    rdfs:label "Other entity" ;
    rdfs:comment "Economic Operator (who is not a Subcontractor) on which the Tenderer relies upon, to meet Selection Criteria." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :OtherEntity .

core-shape:epo-ParticipationCondition a sh:NodeShape ;
    rdfs:label "Participation condition" ;
    rdfs:comment "Criterion that describes a Requirement to take part in a procurement. WG approval 30/05/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ParticipationCondition-epo-hasReservedProcurement ;
    sh:targetClass :ParticipationCondition .

core-shape:epo-ParticipationConditionsSummary a sh:NodeShape ;
    rdfs:label "Participation conditions summary" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ParticipationConditionsSummary-epo-describesObjectiveParticipationRules,
        core-shape:epo-ParticipationConditionsSummary-epo-describesVerificationMethod,
        core-shape:epo-ParticipationConditionsSummary-epo-hasReservedProcurement ;
    sh:targetClass :ParticipationConditionsSummary .

core-shape:epo-ParticipationRequestProcessor a sh:NodeShape ;
    rdfs:label "Participation request processor" ;
    rdfs:comment "A Role of an Agent responsible for processing Requests To Participate." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ParticipationRequestProcessor .

core-shape:epo-ParticipationRequestReceiver a sh:NodeShape ;
    rdfs:label "Participation request receiver" ;
    rdfs:comment "A Role of an Agent responsible for receiving Requests To Participate." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ParticipationRequestReceiver .

core-shape:epo-ParticipationRequestTerm a sh:NodeShape ;
    rdfs:label "Participation request term" ;
    rdfs:comment "Conditions and stipulations defining particularities of requesting participation in a Procedure." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ParticipationRequestTerm-epo-definesParticipationRequestProcessor,
        core-shape:epo-ParticipationRequestTerm-epo-definesParticipationRequestReceiver ;
    sh:targetClass :ParticipationRequestTerm .

core-shape:epo-PaymentExecutor a sh:NodeShape ;
    rdfs:label "Payment executor" ;
    rdfs:comment "A Role of an Agent responsible for executing the Payment." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :PaymentExecutor .

core-shape:epo-Period a sh:NodeShape ;
    rdfs:label "Period" ;
    rdfs:comment "A time interval or a Duration. (WG approval 28/04/2020)" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Period-epo-hasBeginning,
        core-shape:epo-Period-epo-hasEnd,
        core-shape:epo-Period-epo-hasTimePeriod ;
    sh:targetClass :Period .

core-shape:epo-PlannedProcurementPart a sh:NodeShape ;
    rdfs:label "Planned procurement part" ;
    rdfs:comment "A subdivision of a Planned Procurement that may later become one or more Lots or a self-standing Procedure. A Lot or a Procedure can also cover one or more parts of the Planned Procurement. WG Approval 20/06/2019" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-PlannedProcurementPart-epo-foreseesProcurementObject,
        core-shape:epo-PlannedProcurementPart-epo-foreseesTechnique,
        core-shape:epo-PlannedProcurementPart-epo-hasPlannedDuration,
        core-shape:epo-PlannedProcurementPart-epo-hasPlannedPeriod ;
    sh:targetClass :PlannedProcurementPart .

core-shape:epo-Prize a sh:NodeShape ;
    rdfs:label "Prize" ;
    rdfs:comment "A reward given in a Contest. WG approval: 15/04/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Prize-epo-hasPrizeRank,
        core-shape:epo-Prize-epo-hasPrizeValue ;
    sh:targetClass :Prize .

core-shape:epo-Procedure a sh:NodeShape ;
    rdfs:label "Procedure" ;
    rdfs:comment "A legally defined set of administrative activities conducted to conclude one or more Contracts. Additional Information The Procedure is categorised in the law according to different rules determining whether the Procedure is Open, Restricted, Negotiated with or without publicity, etc. (see Procedure Type). WG Approval 20/08/2019" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Procedure-epo-hasAcceleratedProcedureJustification,
        core-shape:epo-Procedure-epo-hasMainFeature,
        core-shape:epo-Procedure-epo-hasProcedureType,
        core-shape:epo-Procedure-epo-hasProcurementScopeDividedIntoLot,
        core-shape:epo-Procedure-epo-involvesBuyer,
        core-shape:epo-Procedure-epo-isAccelerated,
        core-shape:epo-Procedure-epo-isDesignContest,
        core-shape:epo-Procedure-epo-isExecutedByProcurementServiceProvider,
        core-shape:epo-Procedure-epo-isJointProcurement,
        core-shape:epo-Procedure-epo-isResponsibilityOfBuyer,
        core-shape:epo-Procedure-epo-isSubjectToProcedureSpecificTerm,
        core-shape:epo-Procedure-epo-specifiesProcurementCriteriaSummary ;
    sh:targetClass :Procedure .

core-shape:epo-ProcedureSpecificTerm a sh:NodeShape ;
    rdfs:label "Procedure specific term" ;
    rdfs:comment "Gathering class for conditions and stipulations related to a Procedure." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ProcedureSpecificTerm .

core-shape:epo-ProcedureTerm a sh:NodeShape ;
    rdfs:label "Procedure term" ;
    rdfs:comment "Conditions and stipulations defining particularities of the Procedure. (WG approval 23/11/2018)" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ProcedureTerm-epo-definesBudgetProvider,
        core-shape:epo-ProcedureTerm-epo-definesInformationProvider,
        core-shape:epo-ProcedureTerm-epo-definesLotGroup,
        core-shape:epo-ProcedureTerm-epo-definesMediator,
        core-shape:epo-ProcedureTerm-epo-hasCrossBorderLaw,
        core-shape:epo-ProcedureTerm-epo-hasGroupLotEvaluationMethod,
        core-shape:epo-ProcedureTerm-epo-hasLotAwardCombination,
        core-shape:epo-ProcedureTerm-epo-hasMaximumLotSubmissionAllowed,
        core-shape:epo-ProcedureTerm-epo-hasMaximumNumberOfLotsToBeAwarded,
        core-shape:epo-ProcedureTerm-epo-hasNationalProcedureRules,
        core-shape:epo-ProcedureTerm-epo-isAwardedByCPB,
        core-shape:epo-ProcedureTerm-epo-isOneLotOnlyAllowed,
        core-shape:epo-ProcedureTerm-epo-isSubmissionForAllLotsRequired ;
    sh:targetClass :ProcedureTerm .

core-shape:epo-ProcessPlanningTerm a sh:NodeShape ;
    rdfs:label "Process planning term" ;
    rdfs:comment "Conditions and stipulations defining particularities of the unfolding of the Procurement Process." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ProcessPlanningTerm-epo-hasAwardDateScheduled,
        core-shape:epo-ProcessPlanningTerm-epo-hasEstimatedContractNoticePublicationDate,
        core-shape:epo-ProcessPlanningTerm-epo-hasEstimatedTenderInvitationDate ;
    sh:targetClass :ProcessPlanningTerm .

core-shape:epo-ProcurementCriteriaSummary a sh:NodeShape ;
    rdfs:label "Procurement criteria summary" ;
    rdfs:comment "WG approval 24/01/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ProcurementCriteriaSummary-epo-indicatesPerformingStaffInformationRequirement ;
    sh:targetClass :ProcurementCriteriaSummary .

core-shape:epo-ProcurementCriterion a sh:NodeShape ;
    rdfs:label "Procurement criterion" ;
    rdfs:comment "A criterion specific to Procurement. Additional Information: This Procurement Criterion can be only Exclusion Ground, Selection Criterion or Award Criterion. Each of these Criteria can contain subcriteria (Criterion class). WG Approval 23/04/2020" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ProcurementCriterion-epo-hasConstraint,
        core-shape:epo-ProcurementCriterion-epo-hasFormula,
        core-shape:epo-ProcurementCriterion-epo-hasPerformingStaffQualificationInformation,
        core-shape:epo-ProcurementCriterion-epo-hasWeightValueType ;
    sh:targetClass :ProcurementCriterion .

core-shape:epo-ProcurementDocument a sh:NodeShape ;
    rdfs:label "Procurement document" ;
    rdfs:comment "Document produced or referred to by the Buyer to describe or determine elements of the Procurement. Additional information: Procurement Documents are to be accessible since the date of publication of the Contract Notice or the prior information Notice when used as a call for competition. Examples of Procurement Documents are Technical Specifications, the Descriptive Document, proposed conditions of Contract, formats for the presentation of Documents by Candidates and Tenderers, information on generally applicable obligations. Other Documents related to the Procedure such as Notices are not considered to be Procurement Documents. WG Approval 23/05/2019 17:08:30" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ProcurementDocument .

core-shape:epo-ProcurementElement a sh:NodeShape ;
    rdfs:label "Procurement element" ;
    rdfs:comment "Gathering class for critical/central elements in the Procurement Process. TODO: add definition Additional information: Alias: ProcurementComponent" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ProcurementElement-adms-identifier,
        core-shape:epo-ProcurementElement-dct-description,
        core-shape:epo-ProcurementElement-dct-title,
        core-shape:epo-ProcurementElement-epo-hasEstimatedValue,
        core-shape:epo-ProcurementElement-epo-hasInternalIdentifier,
        core-shape:epo-ProcurementElement-epo-usesChannel ;
    sh:targetClass :ProcurementElement .

core-shape:epo-ProcurementObject a sh:NodeShape ;
    rdfs:label "Procurement object" ;
    rdfs:comment "The whole or a division of goods, services or works to be procured. Additional Information: Anything that can specify the procurement content (i.e. goods, services, work) is a Procurement Object. In a sense, such an \"object\" can constitute the \"object of a Contract\". To test whether something is a Procedure Object check if it can have a Purpose and/or CPV classification (<i>The CPV establishes a single classification system for public procurement aimed at standardising the references used by Contracting Authorities and entities to describe the subject of Procurement Contracts.</i>). Note: Procedure, seems to be an exception from this rule. Because it is a conflated term: it carries process properties and \"purpose\" properties." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ProcurementObject-epo-foreseesConcession,
        core-shape:epo-ProcurementObject-epo-foreseesContractSpecificTerm,
        core-shape:epo-ProcurementObject-epo-fulfillsStrategicProcurement,
        core-shape:epo-ProcurementObject-epo-hasAdditionalInformation,
        core-shape:epo-ProcurementObject-epo-hasLaunchFrameworkAgreementMaximumValue,
        core-shape:epo-ProcurementObject-epo-hasLegalBasis,
        core-shape:epo-ProcurementObject-epo-hasLegalBasisDescription,
        core-shape:epo-ProcurementObject-epo-hasPurpose,
        core-shape:epo-ProcurementObject-epo-hasRecurrenceDescription,
        core-shape:epo-ProcurementObject-epo-isCoveredByGPA,
        core-shape:epo-ProcurementObject-epo-isFundedBy,
        core-shape:epo-ProcurementObject-epo-isRecurrent,
        core-shape:epo-ProcurementObject-epo-isSMESuitable,
        core-shape:epo-ProcurementObject-epo-isSubjectToTerm,
        core-shape:epo-ProcurementObject-epo-isUsingEUFunds,
        core-shape:epo-ProcurementObject-epo-usesTechnique ;
    sh:targetClass :ProcurementObject .

core-shape:epo-ProcurementProcedureInformationProvider a sh:NodeShape ;
    rdfs:label "Procurement procedure information provider" ;
    rdfs:comment "A Role of an Agent responsible for providing additional information about the Procurement Procedure." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ProcurementProcedureInformationProvider .

core-shape:epo-ProcurementProcessInformation a sh:NodeShape ;
    rdfs:label "Procurement process information" ;
    rdfs:comment "Information about the temporal unfolding or succession of Procurement Objects." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ProcurementProcessInformation-epo-concernsLot,
        core-shape:epo-ProcurementProcessInformation-epo-concernsProcedure,
        core-shape:epo-ProcurementProcessInformation-epo-isCompetitionTerminated,
        core-shape:epo-ProcurementProcessInformation-epo-isDPSTerminated,
        core-shape:epo-ProcurementProcessInformation-epo-isToBeRelaunched ;
    sh:targetClass :ProcurementProcessInformation .

core-shape:epo-ProcurementServiceProvider a sh:NodeShape ;
    rdfs:label "Procurement service provider" ;
    rdfs:comment "Role of a public or private body which offers ancillary purchasing activities on the market. Additional information \"Ancillary Purchasing Activities\" means activities consisting in the provision of support to purchasing activities, in particular in the following forms: (a) technical infrastructure enabling Contracting Authorities to award Public Contracts or to conclude Framework Agreements for works, supplies or services; (b) advice on the conduct or design of public Procurement Procedures; (c) preparation and management of Procurement Procedures on behalf and for the account of the Contracting Authority concerned; Source: Directive 2014/24/EU, Article 2, paragraphs 17 and 15. This would be equivalent to the concept of 'ProcuringEntity' in OCDS: 'The Entity managing the Procurement, which may be different from the Buyer who is paying / using the items being procured'. WG Approval 24/03/2020" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ProcurementServiceProvider-epo-actsOnBehalfOf ;
    sh:targetClass :ProcurementServiceProvider .

core-shape:epo-ProfessionalSuitabilitySummary a sh:NodeShape ;
    rdfs:label "Professional suitability summary" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ProfessionalSuitabilitySummary-epo-describesProfession,
        core-shape:epo-ProfessionalSuitabilitySummary-epo-describesProfessionRelevantLaw,
        core-shape:epo-ProfessionalSuitabilitySummary-epo-hasServiceReservedToParticularProfession ;
    sh:targetClass :ProfessionalSuitabilitySummary .

core-shape:epo-Project a sh:NodeShape ;
    rdfs:label "Project" ;
    rdfs:comment "A collaborative enterprise that is carefully planned to achieve a particular aim." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Project-adms-identifier ;
    sh:targetClass :Project .

core-shape:epo-PurchaseContract a sh:NodeShape ;
    rdfs:label "Purchase contract" ;
    rdfs:comment "A Contract resulting from using a Dynamic Purchasing System Technique or Framework Agreement Technique." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-PurchaseContract-epo-followsRulesSetBy,
        core-shape:epo-PurchaseContract-epo-resultsFromMiniCompetitionAwardOutcome ;
    sh:targetClass :PurchaseContract .

core-shape:epo-Purpose a sh:NodeShape ;
    rdfs:label "Purpose" ;
    rdfs:comment "The description of the objectives related to a Procurement. Additional information: The description of the objectives includes the Subject Matter and Quantities. The quantification of the objectives related to a procurement. To be re-reviewed by the WG the soonest. (WG to be discussed, this was pointed out on the 09/04/2019 14:38:25 WG Meeting) The old definition read as follows: The description of the objectives related to a procurement. (WG approval 05/12/2018)" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Purpose-epo-hasAdditionalClassification,
        core-shape:epo-Purpose-epo-hasMainClassification,
        core-shape:epo-Purpose-epo-hasTotalQuantity ;
    sh:targetClass :Purpose .

core-shape:epo-QualificationCriteriaSummary a sh:NodeShape ;
    rdfs:label "Qualification criteria summary" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-QualificationCriteriaSummary-epo-hasConditionVerificationMethod,
        core-shape:epo-QualificationCriteriaSummary-epo-hasQualificationCondition ;
    sh:targetClass :QualificationCriteriaSummary .

core-shape:epo-QualificationCriterion a sh:NodeShape ;
    rdfs:label "Qualification criterion" ;
    rdfs:comment "Criterion used in the first stage of procurement. WG approval 30/05/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :QualificationCriterion .

core-shape:epo-Quantity a sh:NodeShape ;
    rdfs:label "Quantity" ;
    rdfs:comment "A counted number of non-monetary units possibly including fractions." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Quantity-epo-hasQuantityValue,
        core-shape:epo-Quantity-epo-hasUnitCode,
        core-shape:epo-Quantity-epo-hasUnitDescription ;
    sh:targetClass :Quantity .

core-shape:epo-RequestForClarification a sh:NodeShape ;
    rdfs:label "Request for clarification" ;
    rdfs:comment "A demand for elucidation of received information. Additional Information: Requests for clarification are usually used by Buyers during the process of award or evaluation to understand specific aspects of the Tender without altering the Tender. WG approval 20/04/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :RequestForClarification .

core-shape:epo-RequestForParticipation a sh:NodeShape ;
    rdfs:label "Request for participation" ;
    rdfs:comment "Application of an Economic Operator to be included in a Procurement Procedure. WG approval: 20/04/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :RequestForParticipation .

core-shape:epo-ReviewDecision a sh:NodeShape ;
    rdfs:label "Review decision" ;
    rdfs:comment "Information about Review Decisions." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ReviewDecision-epo-hasConfirmedIrregularityType,
        core-shape:epo-ReviewDecision-epo-hasDecisionDate,
        core-shape:epo-ReviewDecision-epo-hasRemedyValue,
        core-shape:epo-ReviewDecision-epo-hasReviewDecisionType,
        core-shape:epo-ReviewDecision-epo-providesRulingOnRemedy,
        core-shape:epo-ReviewDecision-epo-resolvesReviewRequest ;
    sh:targetClass :ReviewDecision .

core-shape:epo-ReviewIrregularitySummary a sh:NodeShape ;
    rdfs:label "Review irregularity summary" ;
    rdfs:comment "Information about the number and type of requests the Buyer received to review any of its decisions (e.g. the Technical Specifications, Award Decision). Additional information: This class corresponds in eForms to BG-613 Buyer Review Requests." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ReviewIrregularitySummary-epo-hasIrregularityType,
        core-shape:epo-ReviewIrregularitySummary-epo-hasReviewIrregularityCount ;
    sh:targetClass :ReviewIrregularitySummary .

core-shape:epo-ReviewObject a sh:NodeShape ;
    rdfs:label "Review object" ;
    rdfs:comment "Information about a Review Request or a Review Decision. Additional information: This class corresponds to the BG-714 Review in eForms." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ReviewObject-epo-hasElementReference,
        core-shape:epo-ReviewObject-epo-hasReviewURL,
        core-shape:epo-ReviewObject-epo-refersToPreviousReview ;
    sh:targetClass :ReviewObject .

core-shape:epo-ReviewProcedureInformationProvider a sh:NodeShape ;
    rdfs:label "Review procedure information provider" ;
    rdfs:comment "A Role of an Agent who is providing more information on the time limits for review Procedures." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ReviewProcedureInformationProvider .

core-shape:epo-ReviewRequest a sh:NodeShape ;
    rdfs:label "Review request" ;
    rdfs:comment "Information about requests to review procedures." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ReviewRequest-epo-hasAllegedIrregularityType,
        core-shape:epo-ReviewRequest-epo-hasNumberOfReviewRequests,
        core-shape:epo-ReviewRequest-epo-hasRequestDate,
        core-shape:epo-ReviewRequest-epo-hasReviewRequestFee,
        core-shape:epo-ReviewRequest-epo-hasWithdrawalDate,
        core-shape:epo-ReviewRequest-epo-hasWithdrawalReason,
        core-shape:epo-ReviewRequest-epo-isWithdrawn,
        core-shape:epo-ReviewRequest-epo-requestsRemedyType ;
    sh:targetClass :ReviewRequest .

core-shape:epo-ReviewRequestSummary a sh:NodeShape ;
    rdfs:label "Review request summary" ;
    rdfs:comment "Summary information about the requests the Buyer received to review any of its decisions (e.g. the technical specifications, award decision), as set out in Art. 1(5) of Directive 89/665/EEC and Directive 92/13/EEC, and about the complainants that submitted the requests. Additional information: This class corresponds in eForms to BG-612 Buyer Review Summary." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ReviewRequestSummary-epo-concernsReviewSummaryForLot,
        core-shape:epo-ReviewRequestSummary-epo-hasReviewIrregularitySummary,
        core-shape:epo-ReviewRequestSummary-epo-hasTotalNumberOfComplainants ;
    sh:targetClass :ReviewRequestSummary .

core-shape:epo-ReviewRequester a sh:NodeShape ;
    rdfs:label "Review requester" ;
    rdfs:comment "Role of an Agent who requests the review of a (Procurement) Procedure. WG Approval 23/10/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :ReviewRequester .

core-shape:epo-ReviewTerm a sh:NodeShape ;
    rdfs:label "Review term" ;
    rdfs:comment "Conditions and stipulations defining particularities of the review. WG approval 23/11/2018" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-ReviewTerm-epo-definesReviewProcedureInformationProvider,
        core-shape:epo-ReviewTerm-epo-definesReviewer,
        core-shape:epo-ReviewTerm-epo-hasReviewDeadline,
        core-shape:epo-ReviewTerm-epo-hasReviewDeadlineInformation,
        core-shape:epo-ReviewTerm-epo-hasReviewProcedure ;
    sh:targetClass :ReviewTerm .

core-shape:epo-Reviewer a sh:NodeShape ;
    rdfs:label "Reviewer" ;
    rdfs:comment "Role of an Agent who investigates the overall correctness of a Procurement Procedure, producing a related report. Additional Information: Any Organisation or Person may request a review of a Procurement Procedure. WG approval: 20/04/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Reviewer-epo-hasReviewBodyType ;
    sh:targetClass :Reviewer .

core-shape:epo-SecurityClearanceTerm a sh:NodeShape ;
    rdfs:label "Security clearance term" ;
    rdfs:comment "Conditions and stipulations about the status requested of individuals allowing them access to classified information (state or organisational secrets) or to restricted areas, after completion of a thorough background check. Additional information: This corresponds in eForms to BT-578, BT-78, BT-732 . WG approval 20/06/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-SecurityClearanceTerm-dct-description,
        core-shape:epo-SecurityClearanceTerm-epo-hasDeadline,
        core-shape:epo-SecurityClearanceTerm-epo-isSecurityClearanceRequired ;
    sh:targetClass :SecurityClearanceTerm .

core-shape:epo-SelectedCandidateList a sh:NodeShape ;
    rdfs:label "Selected candidate list" ;
    rdfs:comment "Record of Candidates admitted to take part in award phases of procurements. WG approval 30/05/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-SelectedCandidateList-epo-containsCandidate,
        core-shape:epo-SelectedCandidateList-epo-hasStartDate ;
    sh:targetClass :SelectedCandidateList .

core-shape:epo-SelectionCriteriaSummary a sh:NodeShape ;
    rdfs:label "Selection criteria summary" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-SelectionCriteriaSummary-epo-describesMinimumLevelOfStandards,
        core-shape:epo-SelectionCriteriaSummary-epo-hasSelectionCriteriaStatedInProcurementDocuments ;
    sh:targetClass :SelectionCriteriaSummary .

core-shape:epo-SelectionCriterion a sh:NodeShape ;
    rdfs:label "Selection criterion" ;
    rdfs:comment "Criterion that describes a capacity Requirement that the Economic Operator needs to fulfill to participate in the procurement. Additional Information: Selection criteria may relate to: (a) suitability to pursue the professional activity; (b) economic and financial standing; (c) technical and professional ability WG approval 31/10/2018" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-SelectionCriterion-epo-hasSelectionCriteriaUsage,
        core-shape:epo-SelectionCriterion-epo-hasSelectionCriterionType,
        core-shape:epo-SelectionCriterion-epo-isUsedForCandidateRestriction ;
    sh:targetClass :SelectionCriterion .

core-shape:epo-SelectionEvaluationTerm a sh:NodeShape ;
    rdfs:label "Selection evaluation term" ;
    rdfs:comment "Conditions and stipulations defining particularities of the evaluation of Selection Criteria." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :SelectionEvaluationTerm .

core-shape:epo-SocialProcurement a sh:NodeShape ;
    rdfs:label "Social procurement" ;
    rdfs:comment "Approach whereby Buyers seek to procure by fulfilling social objectives. Additional Information: Socially Responsible Public Procurement (SRPP) - SRPP means Procurement Operations that take into account one or more of the following social considerations: employment opportunities, decent work, compliance with social and labour rights, social inclusion (including persons with disabilities), equal opportunities, accessibility design for all, taking account of sustainability criteria, including ethical trade issues and wider voluntary compliance with corporate social responsibility (CSR), while observing the principles enshrined in the Treaty for the European Union (TFEU) and the Procurement Directives. Source: Buying Social - A Guide to Taking Account of Social Considerations in Public Procurement (Publications Office of the European Union, 2011) https://op.europa.eu/en/publication-detail/-/publication/cb70c481-0e29-4040-9be2-c408cddf081f/language-en See Article 18 and Annex X Directive 2014/24." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-SocialProcurement-epo-fulfillsRequirement ;
    sh:targetClass :SocialProcurement .

core-shape:epo-SpecificDuration a sh:NodeShape ;
    rdfs:label "Specific duration" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-SpecificDuration-time-numericDuration,
        core-shape:epo-SpecificDuration-time-unitType ;
    sh:targetClass :SpecificDuration .

core-shape:epo-StatisticalInformation a sh:NodeShape ;
    rdfs:label "Statistical information" ;
    rdfs:comment "Statistical data on the Procedure and the Lot. Additional Information At the present time Procurement Procedures are not fully electronic. At a later date, information on the Tenders received could be inferred by the data in the eProcurement System. Therefore this class is temporal and should cease to exist in fully electronic Procurement. The need for its presence responds also to the alignment with the Regulation (EU) 2019/1780 (eForms). Attention will have to be paid in the future to possible inconsistencies derived from data placed in other classes and data held in the Statistical Information class; e.g. the TenderEvaluation class (see eEvaluation diagram) has the attribute admissibileTender indicator, which in case of being false, may enter in contradiction with the highest or lowest Tender value for that very same inadmissible Tender. WG Approval 12/12/2019" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :StatisticalInformation .

core-shape:epo-StrategicProcurement a sh:NodeShape ;
    rdfs:label "Strategic procurement" ;
    rdfs:comment "Public Procurement that contributes to achieving pressing policy goals. Additional Information: Specific strategic goals could be, for example, Environmental Protection, innovation, job creation and the development of small and medium enterprises. This corresponds in eForms to BG-713 Strategic Procurement. The subclasses are given by the choices in BT-06 Strategic Procurement. Based on https://legalinstruments.oecd.org/en/instruments/OECD-LEGAL-0411 (see paragraph on \"background information\". WG Approval 10/03/2020" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-StrategicProcurement-epo-hasNonAccessibilityCriterionJustification,
        core-shape:epo-StrategicProcurement-epo-hasStrategicProcurementDescription,
        core-shape:epo-StrategicProcurement-epo-includesAccessibilityCriterion ;
    sh:targetClass :StrategicProcurement .

core-shape:epo-SubcontractTerm a sh:NodeShape ;
    rdfs:label "Subcontract term" ;
    rdfs:comment "A concept to describe the main information regarding the share of parts of the Contract to third parties." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-SubcontractTerm-dct-description,
        core-shape:epo-SubcontractTerm-epo-hasMaximumShare,
        core-shape:epo-SubcontractTerm-epo-hasMinimumShare,
        core-shape:epo-SubcontractTerm-epo-hasMinimumSubcontractorsProposedObligation,
        core-shape:epo-SubcontractTerm-epo-hasSubcontractingInvolved,
        core-shape:epo-SubcontractTerm-epo-hasSubcontractingObligation,
        core-shape:epo-SubcontractTerm-epo-hasSubcontractorsProposedAboveObligation ;
    sh:targetClass :SubcontractTerm .

core-shape:epo-SubcontractingEstimate a sh:NodeShape ;
    rdfs:label "Subcontracting estimate" ;
    rdfs:comment "Information on the approximation of the foreseen Subcontracting." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-SubcontractingEstimate-dct-description,
        core-shape:epo-SubcontractingEstimate-epo-hasEstimatedPercentage,
        core-shape:epo-SubcontractingEstimate-epo-hasSubcontractingEstimatedValue,
        core-shape:epo-SubcontractingEstimate-epo-hasSubjectMatter ;
    sh:targetClass :SubcontractingEstimate .

core-shape:epo-Subcontractor a sh:NodeShape ;
    rdfs:label "Subcontractor" ;
    rdfs:comment "A Role of an Agent that has an agreement to perform part or all of the obligations of another Agents's Contract. Additional information For some Procedures, the Subcontractor signs as well the Contract between the Buyer and the Contractor. At tendering time, entities relied upon by the Economic Operators can be Subcontractors or not. When modelling ESPD we well analyze whether we need or not a Role named \"relied upon\". WG approval 05/08/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :Subcontractor .

core-shape:epo-SubmissionStatisticalInformation a sh:NodeShape ;
    rdfs:label "Submission statistical information" ;
    rdfs:comment "Statistical information about submissions on a given competition, either at Lot level or Mini-Competition level. WG approval 30/05/2023" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-SubmissionStatisticalInformation-epo-hasAbnormallyLowTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasEEAReceivedTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasEUReceivedTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasElectronicTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasEstimatedTotalSubcontracts,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasHighestReceivedTenderValue,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasInadmissibleTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasLowestReceivedTenderValue,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasMediumTenderPerLots,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasNonEEAReceivedTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasNonEUReceivedTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasNumberOfTenderersInvited,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasOtherCountriesReceivedTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasReceivedMicroTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasReceivedParticipationRequests,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasReceivedSmallTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasReceivedSubmissionType,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasReceivedTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasSMEReceivedTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-hasUnverifiedTenders,
        core-shape:epo-SubmissionStatisticalInformation-epo-summarisesInformationForAwardOutcome ;
    sh:targetClass :SubmissionStatisticalInformation .

core-shape:epo-SubmissionTerm a sh:NodeShape ;
    rdfs:label "Submission term" ;
    rdfs:comment "Conditions and stipulations defining particularities of submitting Documents to the Buyer. Additional Information: These Documents can be Tenders, Request To Participate and expressions of interest. WG Approval 14/07/2020" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-SubmissionTerm-epo-definesTenderProcessor,
        core-shape:epo-SubmissionTerm-epo-definesTenderReceiver,
        core-shape:epo-SubmissionTerm-epo-hasEAuctionURL,
        core-shape:epo-SubmissionTerm-epo-hasECataloguePermission,
        core-shape:epo-SubmissionTerm-epo-hasESubmissionPermission,
        core-shape:epo-SubmissionTerm-epo-hasGuaranteeDescription,
        core-shape:epo-SubmissionTerm-epo-hasLanguage,
        core-shape:epo-SubmissionTerm-epo-hasLateSubmissionInformationDescription,
        core-shape:epo-SubmissionTerm-epo-hasLateSubmissionPermission,
