        core-shape:epo-SubmissionTerm-epo-hasTenderSubcontractingInformation,
        core-shape:epo-SubmissionTerm-epo-hasTenderValidityDuration,
        core-shape:epo-SubmissionTerm-epo-hasTenderValidityPeriod,
        core-shape:epo-SubmissionTerm-epo-hasVariantPermission,
        core-shape:epo-SubmissionTerm-epo-isAdvancedElectronicSignatureRequired,
        core-shape:epo-SubmissionTerm-epo-isGuaranteeRequired,
        core-shape:epo-SubmissionTerm-epo-isMultipleTenderSubmissionAllowed ;
    sh:targetClass :SubmissionTerm .

core-shape:epo-System a sh:NodeShape ;
    rdfs:label "System" ;
    rdfs:comment "Software application used for performing Procurement activities. WG Approval 28/04/2020" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-System-dct-description,
        core-shape:epo-System-epo-isOwnedByAgent ;
    sh:targetClass :System .

core-shape:epo-TaxInformationProvider a sh:NodeShape ;
    rdfs:label "Tax information provider" ;
    rdfs:comment "A Role of an Agent responsible for providing information concerning the general regulatory framework for taxes." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :TaxInformationProvider .

core-shape:epo-TechnicalAbilitySummary a sh:NodeShape ;
    rdfs:label "Technical ability summary" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :TechnicalAbilitySummary .

core-shape:epo-Technique a sh:NodeShape ;
    rdfs:label "Technique" ;
    rdfs:comment "Method used for conducting Procurement Procedures. Addtional information: This corresponds in eForms to BG-706 Techniques. Several Techniques can be combined in one single Procurement Procedure (e.g. eAuction can be carried out in a Framework Agreement or DPS). WG Approval 19/09/2019" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Technique-dct-description,
        core-shape:epo-Technique-epo-hasUsage,
        core-shape:epo-Technique-epo-hasValidityPeriod ;
    sh:targetClass :Technique .

core-shape:epo-Tender a sh:NodeShape ;
    rdfs:label "Tender" ;
    rdfs:comment "Information submitted by the Economic Operator to specify its Offer regarding a specific Lot, in response to the call for Tender. (WG approval 03/05/2022)" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Tender-epo-foreseesConcession,
        core-shape:epo-Tender-epo-foreseesSubcontracting,
        core-shape:epo-Tender-epo-hasElectronicSubmission,
        core-shape:epo-Tender-epo-hasFinancialOfferValue,
        core-shape:epo-Tender-epo-hasItemCountryOfOrigin,
        core-shape:epo-Tender-epo-hasSubcontracting,
        core-shape:epo-Tender-epo-isSubjectToGrouping,
        core-shape:epo-Tender-epo-isSubmitedBy,
        core-shape:epo-Tender-epo-isSubmittedForLot,
        core-shape:epo-Tender-epo-isVariant,
        core-shape:epo-Tender-epo-specifiesSubcontractors ;
    sh:targetClass :Tender .

core-shape:epo-TenderAwardOutcome a sh:NodeShape ;
    rdfs:label "Tender award outcome" ;
    rdfs:comment "Result concerning the Tender attributed by the Awarder." ;
