core-shape:epo-TenderGroup a sh:NodeShape ;
    rdfs:label "Tender group" ;
    rdfs:comment "Specific Offer in response to a Lot Group. Additional Information: This class is generally used to provide the Monetary Value in response to a Lot Group." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-TenderGroup-adms-identifier,
        core-shape:epo-TenderGroup-dct-description,
        core-shape:epo-TenderGroup-dct-title,
        core-shape:epo-TenderGroup-epo-comprisesTender,
        core-shape:epo-TenderGroup-epo-hasTotalValue,
        core-shape:epo-TenderGroup-epo-isSubmittedForLotGroup ;
    sh:targetClass :TenderGroup .

core-shape:epo-TenderProcessor a sh:NodeShape ;
    rdfs:label "Tender processor" ;
    rdfs:comment "A Role of an Agent responsible for processing Tenders." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :TenderProcessor .

core-shape:epo-TenderReceiver a sh:NodeShape ;
    rdfs:label "Tender receiver" ;
    rdfs:comment "A Role of an Agent responsible for receiving Tenders." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :TenderReceiver .

core-shape:epo-Tenderer a sh:NodeShape ;
    rdfs:label "Tenderer" ;
    rdfs:comment "A Role of an Agent that has submitted a Tender. Additional Information: A Tenderer is an Economic Operator or group of Economic Operators that has submitted a Tender. WG approval 05/08/2021" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Tenderer-epo-substantiatesExclusionGround ;
    sh:targetClass :Tenderer .

core-shape:epo-Term a sh:NodeShape ;
    rdfs:label "Term" ;
    rdfs:comment "A governing condition or stipulation." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass :Term .

core-shape:epo-VehicleInformation a sh:NodeShape ;
    rdfs:label "Vehicle information" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-VehicleInformation-epo-concernsGreenProcurement,
        core-shape:epo-VehicleInformation-epo-hasCleanVehicles,
        core-shape:epo-VehicleInformation-epo-hasTotalVehicles,
        core-shape:epo-VehicleInformation-epo-hasZeroEmissionVehicles,
        core-shape:epo-VehicleInformation-epo-specifiesCleanVehicleDirectiveContractType,
        core-shape:epo-VehicleInformation-epo-specifiesCleanVehicleDirectiveVehicleCategory ;
    sh:targetClass :VehicleInformation .

core-shape:epo-Winner a sh:NodeShape ;
    rdfs:label "Winner" ;
    rdfs:comment "A Role of an Agent to whom a Lot is awarded. WG approval 05/08/2021 (revised 26/10/2021)" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:epo-Winner-epo-needsToBeATenderer ;
    sh:targetClass :Winner .

core-shape:foaf-Agent a sh:NodeShape ;
    rdfs:label "Agent" ;
    rdfs:comment "A Person, an Organisation, or a System that acts in Procurement or have the power to act in Procurement. WG Approval 28/04/2020" ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:foaf-Agent-adms-identifier,
        core-shape:foaf-Agent-dct-title,
        core-shape:foaf-Agent-epo-hasAlias,
        core-shape:foaf-Agent-epo-ownsSystem ;
    sh:targetClass foaf:Agent .

core-shape:foaf-Person a sh:NodeShape ;
    rdfs:label "Person" ;
    rdfs:comment "The Person class represents people. Something is a Person if it is a Person. We don't nitpick about whether they're alive, dead, real, or imaginary. The Person class is a sub-class of the Agent class, since all people are considered 'Agents' in FOAF." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:foaf-Person-epo-hasCertification ;
    sh:targetClass foaf:Person .

core-shape:locn-Address a sh:NodeShape ;
    rdfs:label "Address" ;
    rdfs:comment "The particulars of the place where a Person or an Organisation is located. WG Approval 28/04/2020 Additional Information: An \"Address Representation\" as conceptually defined by the INSPIRE Address Representation data type: \"Representation of an address spatial object for use in external application schemas that need to include the basic, address information in a readable way.\". The representation of Addresses varies widely from one country's postal System to another. Even within countries, there are almost always examples of Addresses that do not conform to the stated national standard. At the time of publication, work is progressing on ISO 19160-1 that defines a method through which different Addresses can be converted from one conceptual model to another. This specification was heavily based on the INSPIRE Address Representation data type. It is noteworthy that if an Address is provided using the detailed breakdown suggested by the properties for this class, then it will be INSPIRE-conformant. To this very granular set of properties, we add two further properties: - full address (the complete address as a formatted string) - addressID (a unique identifier for the address) The first of these allows publishers to simply provide the complete Address as one string, with or without formatting. This is analogous to vCard's label property. The addressID is part of the INSPIRE guidelines and provides a hook that can be used to link the Address to an alternative representation, such as vCard or OASIS xAL." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:locn-Address-epo-hasCountryCode,
        core-shape:locn-Address-epo-hasNutsCode,
        core-shape:locn-Address-locn-addressArea,
        core-shape:locn-Address-locn-addressID,
        core-shape:locn-Address-locn-adminUnitL1,
        core-shape:locn-Address-locn-adminUnitL2,
        core-shape:locn-Address-locn-fullAddress,
        core-shape:locn-Address-locn-locatorDesignator,
        core-shape:locn-Address-locn-locatorName,
        core-shape:locn-Address-locn-postCode,
        core-shape:locn-Address-locn-postName,
        core-shape:locn-Address-locn-thoroughfare ;
    sh:targetClass locn:Address .

core-shape:locn-Geometry a sh:NodeShape ;
    rdfs:label "Geometry" ;
    rdfs:comment "The Geometry class provides the means to identify a Location as a point, line, polygon, etc. expressed using coordinates in some coordinate reference System. Additional Information: This class defines the notion of \"Geometry\" at the conceptual level, and it shall be encoded by using different formats (see usage note of the locn:geometry property). We also refer to the Examples section of this specification for a number of different Geometry examples expressed in different formats." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:locn-Geometry-cv-coordinates,
        core-shape:locn-Geometry-cv-latitude,
        core-shape:locn-Geometry-cv-longitude ;
    sh:targetClass locn:Geometry .

core-shape:org-Organization a sh:NodeShape ;
    rdfs:label "Organization" ;
    rdfs:comment "A collection of people organized together into a community or other social, commercial or political structure. The group has some common purpose or reason for existence which goes beyond the set of people belonging to it and can act as an Agent. Organisations are often decomposable into hierarchical structures. (WG approval 23/11/2018)." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:org-Organization-cv-registeredAddress,
        core-shape:org-Organization-epo-hasBuyerLegalType,
        core-shape:org-Organization-epo-hasBuyerLegalTypeDescription,
        core-shape:org-Organization-epo-hasCertification,
        core-shape:org-Organization-epo-hasInternetAddress,
        core-shape:org-Organization-epo-hasLegalFormType,
        core-shape:org-Organization-epo-hasLegalIdentifier,
        core-shape:org-Organization-epo-hasLegalName,
        core-shape:org-Organization-epo-hasMainActivity,
        core-shape:org-Organization-epo-hasMainActivityDescription,
        core-shape:org-Organization-epo-hasPrimaryContactPoint,
        core-shape:org-Organization-epo-hasRegistrationCountry,
        core-shape:org-Organization-epo-hasTaxIdentifier,
        core-shape:org-Organization-locn-address,
        core-shape:org-Organization-org-subOrganizationOf ;
    sh:targetClass org:Organization .

core-shape:person-Person a sh:NodeShape ;
    rdfs:label "Person" ;
    rdfs:comment "A individual human being who may be dead or alive, but not imaginary." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:property core-shape:person-Person-cv-birthDate,
        core-shape:person-Person-cv-registeredAddress,
        core-shape:person-Person-dct-alternative,
        core-shape:person-Person-epo-hasCountryOfBirth,
        core-shape:person-Person-epo-hasNationality,
        core-shape:person-Person-epo-isBeneficialOwnerOf,
        core-shape:person-Person-foaf-familyName,
        core-shape:person-Person-foaf-givenName,
        core-shape:person-Person-foaf-name,
        core-shape:person-Person-person-birthName,
        core-shape:person-Person-person-patronymicName ;
    sh:targetClass person:Person .

core-shape:time-Duration a sh:NodeShape ;
    rdfs:label "Duration" ;
    rdfs:comment "Duration of a temporal extent expressed as a number scaled by a temporal unit." ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:targetClass time:Duration .

core-shape:adms-Identifier-adms-schemaAgency a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "The name of the agency that issued the identifier." ;
    sh:name "Schema agency" ;
    sh:path adms:schemaAgency .

core-shape:adms-Identifier-epo-hasScheme a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "The name of the identification scheme." ;
    sh:name "Has scheme" ;
    sh:path :hasScheme .

core-shape:adms-Identifier-epo-hasSchemeVersion a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "The version of the identification scheme." ;
    sh:name "Has scheme version" ;
    sh:path :hasSchemeVersion .

core-shape:adms-Identifier-skos-notation a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "The literal identifying an entity, like a person or an object." ;
    sh:maxCount 1 ;
    sh:minCount 1 ;
    sh:name "Notation" ;
    sh:path skos:notation .

core-shape:cccev-Constraint-cccev-constrains a sh:PropertyShape ;
    sh:class cccev:InformationConcept ;
    sh:description "Information Concept about which a Constraint expresses a limitation. Additional Information: Information Concepts are tools to make Requirements more machine processable: they allow to provide more detail about a Requirement. This way, Constraints can be made very precise, namely the limit that must be achieved, is a limit on the value for the associated Information Concept. For example, the Information Concept would be the age of a person and the Constraint would be the required age in the context of a specific evaluation." ;
    sh:name "Constrains" ;
    sh:path cccev:constrains ;
    sh:sparql [ sh:select "SELECT ?this ?that WHERE { ?this <http://data.europa.eu/m8g/constrains> ?that . ?that <http://data.europa.eu/m8g/constrains> ?this .}" ] .

core-shape:cccev-Constraint-epo-hasThresholdType a sh:PropertyShape ;
    sh:nodeKind sh:IRI ;
    sh:description "The method to interpret the threshold value as minimum or a maximum. WG Approval 17/09/2019" ;
    sh:name "Has threshold type" ;
    sh:path :hasThresholdType .

core-shape:cccev-Constraint-epo-hasThresholdValue a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:datatype xsd:decimal ;
    sh:description "The cut-off level for a given concept. Additional Information: This value is given as e.g. a minimum score, a maximum number of tenders with the highest score passing (see codelist at-voc:number-threshold)." ;
    sh:maxCount 1 ;
    sh:minCount 1 ;
    sh:name "Has threshold value" ;
    sh:path :hasThresholdValue .

core-shape:cccev-Criterion-cccev-bias a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:datatype xsd:decimal ;
    sh:description "Parameter used to adjust the evaluation of the Criterion. Additional Information: The bias parameter tries to correct a systematic error. For example in procurement, a home bias corresponds to the \"presence of local preferences distorting international specialisation and resource allocation\". When quantified, this systematic error can be removed." ;
    sh:maxCount 1 ;
    sh:name "Bias" ;
    sh:path cccev:bias .

core-shape:cccev-Criterion-cccev-weight a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:datatype xsd:decimal ;
    sh:description "Relative importance of the Criterion. Additional Information: The weight must be between 0 and 1. Usually, all Criteria can be integrated within a weighted sum equal to 1." ;
    sh:maxCount 1 ;
    sh:name "Weight" ;
    sh:path cccev:weight .

core-shape:cccev-Criterion-cccev-weightingConsiderationDescription a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "Explanation of how the weighting of a Criterion is to be used. Additional Information: This description gives the view of the creator of the Criterion weights on how to interpret and use them during the evaluation process." ;
    sh:maxCount 1 ;
    sh:name "Weighting consideration description" ;
    sh:path cccev:weightingConsiderationDescription .

core-shape:cccev-Criterion-dct-type a sh:PropertyShape ;
    sh:nodeKind sh:IRI ;
    sh:description "Category to which the Requirement belongs." ;
    sh:maxCount 1 ;
    sh:name "Type" ;
    sh:path dcterms:type .

core-shape:cccev-Evidence-cccev-confidentialityLevelType a sh:PropertyShape ;
    sh:nodeKind sh:IRI ;
    sh:description "Security classification assigned to an Evidence e.g. classified, sensitive, public. Additional Information: Classifications should be defined by an organisation/country as an outcome of a security assessment." ;
    sh:maxCount 1 ;
    sh:name "Confidentiality level type" ;
    sh:path cccev:confidentialityLevelType .

core-shape:cccev-Evidence-cccev-supportsConcept a sh:PropertyShape ;
    sh:class cccev:InformationConcept ;
    sh:description "Information Concept providing facts found/inferred from the Evidence. Additional Information: Examples of Information Concepts are values found explictly in the evidence such as a birth date or information derived from the Evidence such as \"I am older that 18 years\" or \"this is a FairTrade product\"." ;
    sh:name "Supports concept" ;
    sh:path cccev:supportsConcept ;
    sh:sparql [ sh:select "SELECT ?this ?that WHERE { ?this <http://data.europa.eu/m8g/supportsConcept> ?that . ?that <http://data.europa.eu/m8g/supportsConcept> ?this .}" ] .

core-shape:cccev-Evidence-cccev-supportsRequirement a sh:PropertyShape ;
    sh:class cccev:Requirement ;
    sh:description "Requirement for which the Evidence provides proof." ;
    sh:name "Supports requirement" ;
    sh:path cccev:supportsRequirement ;
    sh:sparql [ sh:select "SELECT ?this ?that WHERE { ?this <http://data.europa.eu/m8g/supportsRequirement> ?that . ?that <http://data.europa.eu/m8g/supportsRequirement> ?this .}" ] .

core-shape:cccev-Evidence-epo-hasValidityPeriod a sh:PropertyShape ;
    sh:class :Period ;
    sh:description "The relation indicating until when a given instance of a concept is applicable. WG approval 30/05/2023" ;
    sh:maxCount 1 ;
    sh:name "Has validity period" ;
    sh:path :hasValidityPeriod ;
    sh:sparql [ sh:select "SELECT ?this ?that WHERE { ?this <http://data.europa.eu/a4g/ontology#hasValidityPeriod> ?that . ?that <http://data.europa.eu/a4g/ontology#hasValidityPeriod> ?this .}" ] .

core-shape:cccev-InformationConcept-adms-identifier a sh:PropertyShape ;
    sh:class adms:Identifier ;
    sh:description "Links a resource to an adms:Identifier class." ;
    sh:maxCount 1 ;
    sh:name "Identifier" ;
    sh:path adms:identifier ;
    sh:sparql [ sh:select "SELECT ?this ?that WHERE { ?this <http://www.w3.org/ns/adms#identifier> ?that . ?that <http://www.w3.org/ns/adms#identifier> ?this .}" ] .

core-shape:cccev-InformationConcept-dct-description a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "An account of the resource. Additional Information: Description may include but is not limited to: an abstract, a table of contents, a graphical representation, or a free-text account of the resource. WG Approval 30/05/2023" ;
    sh:name "Description" ;
    sh:path dcterms:description .

