core-shape:dct-Location-locn-geographicIdentifier a sh:PropertyShape ;
    sh:class adms:Identifier ;
    sh:description "A URI that identifies the Location. Additional Information: GeoNames.org provides stable, widely recognised identifiers for more than 10 million geographical names that can be used as links to further information. For example, http://sws.geonames.org/593116/ identifies the Lithuanian capital Vilnius. Unfortunately these URIs cannot easily be automatically deduced since the URI scheme uses simple numeric codes. Finding a GeoNames identifier for a Location is almost always a manual process. Where such identifiers are known or can be found, however, it is recommended that they be used. Where the Location Class is used to identify a country, if the geonames URI is not known, the recommendation is to use DBpedia URIs of the form http://dbpedia.org/resource/ISO_3166-1:XX where XX is the ISO 3166 two character code for the country. The EU's Publication Office diverges from ISO 3166-1 and uses EL and UK for Greece and the United Kingdom respectively. DBpedia sticks to the ISO codes and so the correct URIs for these countries are: - http://dbpedia.org/resource/ISO_3166-1:GR - http://dbpedia.org/resource/ISO_3166-1:GB even when the geographic name is given as EL or UK. The use of a URIs has added advantages: - it can be used by automated systems to look up additional data (linked data); - a triple store may store only one copy of the URI, whereas if a string is used, a copy of that string is always stored for each and every person in the database. Thus, in large data sets, the saving on memory capacity and the improvement in transmission efficiency can be substantial." ;
    sh:maxCount 1 ;
    sh:name "Geographic identifier" ;
    sh:path locn:geographicIdentifier ;
    sh:sparql [ sh:select "SELECT ?this ?that WHERE { ?this <http://www.w3.org/ns/locn#geographicIdentifier> ?that . ?that <http://www.w3.org/ns/locn#geographicIdentifier> ?this .}" ] .

core-shape:dct-Location-locn-geographicName a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "A textual description for a Location. Additional Information: The INSPIRE Data Specification on Geographical Names provides a detailed model for describing a 'named place', including methods for providing multiple names in multiple scripts. This is beyond what is necessary for the Core Location Vocabulary but, importantly, the concept of a geographic name used here is consistent. A geographic name is a proper noun applied to a spatial object. Taking the example used in the INSPIRE document (page 15), the following are all valid geographic names for the Greek capital: - \"Ana\"@gr-Grek (the Greek endonym written in the Greek script) - \"Ath&#237;na\"@gr-Latn (the standard Romanisation of the endonym) - \"Athens\"@en (the English language exonym) INSPIRE has a detailed (XML-based) method of providing metadata about a geographic name and in XML-data sets that may be the most appropriate method to follow. When using the Core Location Vocabulary in data sets that are not focussed on environmental/geographical data (the use case for INSPIRE), the Code datatype or a simple language identifier may be used to provide such metadata. The country codes defined in ISO 3166 may be used as geographic names and these are generally preferred over either the long form or short form of a country's name (as they are less error prone). The Publications Office of the European Union recommends the use of ISO 3166-1 codes for countries in all cases except two: - use 'UK' in preference to the ISO 3166 code GB for the United Kingdom; - use 'EL' in preference to the ISO 3166 code GR for Greece. Where a country has changed its name or no longer exists (such as Czechoslovakia, Yugoslavia etc.) use the ISO 3166-3 code." ;
    sh:maxCount 1 ;
    sh:name "Geographic name" ;
    sh:path locn:geographicName .

