core-shape:locn-Address-locn-addressID a sh:PropertyShape ;
    sh:class adms:Identifier ;
    sh:description "A globally unique identifier for each instance of an Address. Additional Information: The concept of adding a globally unique identifier for each instance of an address is a crucial part of the INSPIRE data spec. A number of EU countries have already implemented an ID (a UUID) in their Address Register/gazetteer, among them Denmark. OASIS xAL also includes an address identifier. It is the address Identifier that allows an address to be represented in a format other than INSPIRE whilst remaining conformant to the Core Vocabulary. The INSPIRE method of representing addresses is very detailed, designed primarily for use in databases of addresses. Whilst data that is published in full conformance with the INSPIRE data structure can be made available using the Location Core Vocabulary the reverse is not true since the Core Vocabulary allows much greater flexibility. Many datasets that include address data as one piece of information about something else are likely to have that data in simpler formats. These might be tailored to the specific need of the dataset, follow a national norm, or make use of a standard like vCard. To provide maximum flexibility in the Core Vocabulary, whilst remaining interoperable with INSPIRE Address Guidelines (which EU Member States are obliged to use), the Location Core Vocabulary provides the extra property of full address and makes use of INSPIRE's addressID." ;
    sh:maxCount 1 ;
    sh:name "Address i d" ;
    sh:path locn:addressID ;
    sh:sparql [ sh:select "SELECT ?this ?that WHERE { ?this <http://www.w3.org/ns/locn#addressID> ?that . ?that <http://www.w3.org/ns/locn#addressID> ?this .}" ] .

core-shape:locn-Address-locn-adminUnitL1 a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "The name or names of a unit of administration related to the exercise of jurisdictional rights, for local, regional and national governance. Level 1 refers to the uppermost administrative unit for the address, almost always a country. Additional Information: Best practice is to use the ISO 3166-1 code but if this is inappropriate for the context, country names should be provided in a consistent manner to reduce ambiguity. For example, either write 'France' or 'FRA' consistently throughout the dataset and avoid mixing the two. The Country controlled vocabulary from the Publications Office can be reused for this." ;
    sh:maxCount 1 ;
    sh:name "Admin unit l1" ;
    sh:path locn:adminUnitL1 .

core-shape:locn-Address-locn-adminUnitL2 a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "The name or names of a unit of administration related to the exercise of jurisdictional rights, for local, regional and national governance. Level 2 refers to the region of the address, usually a county, state or other such area that typically encompasses several localities. Additional Information: Some recommended codelists from the EU Publications Office include: Administrative Territorial Units (ATU), NUTS and Local Administrative Units (LAU). The first arrondissement of Paris is for example expressed as \"http://publications.europa.eu/resource/authority/atu/FRA_AR_PAR01\" in the ATU controlled vocabulary." ;
    sh:maxCount 1 ;
    sh:name "Admin unit l2" ;
    sh:path locn:adminUnitL2 .

core-shape:locn-Address-locn-fullAddress a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "The complete address written as a formatted string. Additional Information: Use of this property is recommended as it will not suffer any misunderstandings that might arise through the breaking up of an address into its component parts. This property is analogous to vCard's label property but with two important differences: (1) formatting is not assumed so that, unlike vCard label, it may not be suitable to print this on an address label, (2) vCard's label property has a domain of vCard Address; the fullAddress property has no such restriction. An example of a full address is \"Champ de Mars, 5 Avenue Anatole France, 75007 Paris, France\"." ;
    sh:maxCount 1 ;
    sh:name "Full address" ;
    sh:path locn:fullAddress .

core-shape:locn-Address-locn-locatorDesignator a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "A number or a sequence of characters which allows a user or an application to interpret, parse and format the locator within the relevant scope. A locator may include more locator designators. Additional Information: In simpler terms, this is the building number, apartment number, etc. For an address such as \"Flat 3, 17 Bridge Street\", the locator is \"flat 3, 17\"." ;
    sh:maxCount 1 ;
    sh:name "Locator designator" ;
    sh:path locn:locatorDesignator .

core-shape:locn-Address-locn-locatorName a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "Proper noun(s) applied to the real world entity identified by the locator. Additional Information: The locator name could be the name of the property or complex, of the building or part of the building, or it could be the name of a room inside a building. The key difference between a locator and a locator name is that the latter is a proper name and is unlikely to include digits. For example, \"Shumann, Berlaymont\" is a meeting room within the European Commission headquarters for which locator name is more appropriate than locator." ;
    sh:maxCount 1 ;
    sh:name "Locator name" ;
    sh:path locn:locatorName .

core-shape:locn-Address-locn-postCode a sh:PropertyShape ;
    rdfs:isDefinedBy core-shape:core-shape ;
    sh:or ( [ sh:datatype xsd:string ] [ sh:datatype rdf:langString ] ) ;
    sh:description "The post/zip code of an address. (INSPIRE's definition is \"A code created and maintained for postal purposes to identify a subdivision of addresses and postal delivery points.\") Additional Information: Post codes are common elements in many countries' postal address systems. One of the many post codes of Paris is for example \"75000\"." ;
    sh:maxCount 1 ;
    sh:name "Post code" ;
    sh:path locn:postCode .

